INSERT INTO `cms_pages` (`id`, `title`, `description`, `url`, `status`, `created_at`, `updated_at`, `meta_title`, `meta_description`, `meta_keywords`) VALUES
(1, 'Shipping Policy', '<div class=\"col-xs-10 w3ls_about_grid_left2\">\r\n<div class=\"col-xs-10 w3ls_about_grid_left2\">\r\n<p><strong>Delivery Options</strong></p>\r\n<p>We have the following delivery methods for us to work well together</p>\r\n<p>If you register as a subscriber, we do not make your personally identifiable information available to anyone unless required by law to do so.</p>\r\n<p><strong>Collection</strong></p>\r\n<p>You can also collect your parcel from our office in Pretoria; (416 Seder, 380 Sisulu Street, Pretoria, South Africa, 0001) from 8AM - 5PM on weekdays. Weekends collections are done on arrangements.</p>\r\n<p>Post delivery</p>\r\n<p>We use the Fastway Couriers to deliver to any valid South African postal address. We will send you a tracking number by email when we dispatch your order and you should receive a post office collection slip about 7-10 days later. You can then collect the parcel from your local post office counter. Postal delivery is R105 on all eligible orders.</p>\r\n<p><strong>Courier</strong></p>\r\n<p>This is a door-to-door service. You must supply us with your physical address and someone will need to be available at the address to receive the delivery. Deliveries are made during business hours from Monday to Friday. In main centres, this will reach you within 5-7 business days of dispatch. Main centres include properties within a 50km radius of the major cities in South Africa. If you are not in a main centre, it may take a few days longer. We do not deliver by courier to plots, farms, mines, military bases, major chain stores, power stations, game reserves and lodges, airports or harbours, and should your delivery address fall into one of these categories you will be liable for the extra costs incurred in delivering or returning the parcel. We offer delivery of parcels up to 10kg. Delivery on orders over 10kg is calculated based on mass, value, and number of items in the order.</p>\r\n</div>\r\n</div>', 'shipping-policy', 1, '2019-03-20 09:27:09', '2019-08-09 06:32:19', '', '', ''),
(2, 'Privacy Policy', '<div class=\"col-xs-10 w3ls_about_grid_left2\">\r\n<p><strong>The following policy applies to subscribers who want to get the latest updates</strong></p>\r\n<p>If you register as a subscriber, we do not make your personally identifiable information available to anyone unless required by law to do so.</p>\r\n<p><strong>Information Collected from E-mail:</strong></p>\r\n<p>When you purchase something from our store, as part of the buying and selling process, we collect the personal information you give us such as your name, address and email address. When you browse our store, we also automatically receive your computer&rsquo;s internet protocol (IP) address in order to provide us with information that helps us learn about your browser and operating system. Email marketing (if applicable): With your permission, we may send you emails about our store, new products and other updates.</p>\r\n<p><strong>Privacy Policy for All Visitors</strong></p>\r\n<p><strong>This is information Collected and Stored Automatically:</strong></p>\r\n<p>The Internet protocol (IP) address from which you access our web site. An IP address is a unique number that is automatically assigned to the computer you are using whenever you are surfing the web.</p>\r\n<p>The type of browsers, such as Internet Explorer or Mozilla, and operating systems, such as Windows Vista or MacOs, used to access our site.</p>\r\n<p>The date and time our site is accessed, for the purpose of traffic and statistical monitoring.</p>\r\n<p>The pages visited, for the purpose of improving the usefulness of our web site by providing helpful links and removing pages that are not read.</p>\r\n<p>This information does not identify you personally.</p>\r\n<p>We use this information to make our site more useful to visitors by learning the number of visitors to our site, the number of pages served, and the level of demand for specific pages. We do not track or record information about identifiable individuals and their visits.</p>\r\n<p><strong>Consent</strong></p>\r\n<p>When you provide us with personal information to complete a transaction, verify your credit card, place an order, arrange for a delivery or return a purchase, we imply that you consent to our collecting it and using it for that specific reason only. If we ask for your personal information for a secondary reason, like marketing, we will either ask you directly for your expressed consent or provide you with an opportunity to say no.</p>\r\n<p>You may send an email to helpmyworld@icloud.com to stop any receiving emails from us or for us to stop using your information</p>\r\n<p><strong>Disclosure</strong></p>\r\n<p>We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Third-Party Services</strong></p>\r\n<p>In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us. However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions. For these providers, we recommend that you read their privacy policies so you can understand the manner in which your personal information will be handled by these providers. In particular, remember that certain providers may be located in or have facilities that are located in a different jurisdiction than either you or us. So if you elect to proceed with a transaction that involves the services of a third-party service provider, then your information may become subject to the laws of the jurisdiction(s) in which that service provider or its facilities are located. As an example, if you are located in South Africa and your transaction is processed by a payment gateway located in the United States, then your personal information used in completing that transaction may be subject to disclosure under United States legislation, including the Patriot Act. Once you leave our store&rsquo;s website or are redirected to a third-party website or application, you are no longer governed by this Privacy Policy or our website&rsquo;s Terms of Service.</p>\r\n<p><strong>Security</strong></p>\r\n<p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed. If you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL) and stored with AES-256 encryption. Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards.</p>\r\n<p><strong>Changes to the privacy policy</strong></p>\r\n<p>We reserve the right to modify this privacy policy at any time, so please review it frequently. Changes and clarifications will take effect immediately upon their posting on the website. If we make material changes to this policy, we will notify you here that it has been updated, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we use and/or disclose it. If our store is acquired or merged with another company, your information may be transferred to the new owners so that we may continue to sell products to you.</p>\r\n<p><strong>Questions and contact information</strong></p>\r\n<p>If you would like to: access, correct, amend or delete any personal information we have about you, register a complaint, or simply want more information contact our Privacy Compliance Officer at&nbsp;<a href=\"mailto:rorisang@helpmyworld.co.za\">rorisang@helpmyworld.co.za</a> or by mail at Helpmyworld [Re: Privacy Compliance Officer] 416 Seder, 380 Sisulu street, Pretoria, South Africa, 0001</p>\r\n</div>', 'privacy-policy', 1, '2019-03-20 09:27:48', '2019-08-09 06:38:33', '', '', ''),
(3, 'Cancellation and Refund', '<div class=\"col-xs-10 w3ls_about_grid_left2\">\r\n<p style=\"text-align: justify;\"><strong>Returns</strong></p>\r\n<p style=\"text-align: justify;\">If you are not happy about an item, you may arrange to return it to us for a refund or exchange.</p>\r\n<p style=\"text-align: justify;\">Returns will be accepted only if the item is in the original condition.</p>\r\n<p style=\"text-align: justify;\">Please use your order or proof of payment as reference</p>\r\n<p style=\"text-align: justify;\">Returns must be done within 48 hours of receipt.</p>\r\n<p style=\"text-align: justify;\">We will not accept used items or products even if it is within stipulated hours of our return policy; we reserve the right to determine the condition of the product or items.</p>\r\n<p style=\"text-align: justify;\">Once we receive and accept the returned product, your refund will be processed through your original method of payment within 5 - 7 working days depending on your bank in the case of electronic payments.</p>\r\n<p style=\"text-align: justify;\"><strong>How to cancel or make a return</strong></p>\r\n<p style=\"text-align: justify;\">Email us at <a href=\"mailto:rorisang@helpmyworld.co.za\">rorisang@helpmyworld.co.za</a> or call us on 071 871 7637 to arrange for your return</p>\r\n<p style=\"text-align: justify;\">Securely pack your return parcel</p>\r\n<p style=\"text-align: justify;\">Depending on your choice of the collection - please take your parcel to the Post Office (Speed Service counter) or the Courier will collect directly from you on an agreed date and time.</p>\r\n<p style=\"text-align: justify;\">Upon arrangements returns will also be accepted at the following address: 416 Seder, 380 Sisulu Street, Pretoria, South Africa, 0001 from 8AM - 5PM on weekdays.</p>\r\n</div>', 'cancellation-and-refund', 1, '2019-03-20 09:29:30', '2019-08-09 06:34:19', '', '', ''),
(4, 'Terms of Service', '<div class=\"col-xs-10 w3ls_about_grid_left2\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">This website is operated by Helpmyworld Publishing. Throughout the site, the terms &ldquo;we&rdquo;, &ldquo;us&rdquo; and &ldquo;our&rdquo; refer to Helpmyworld Publishing and Helpmyworld. Helpmyworld Publishing /Helpmyworld offers this website, including all information, tools, and services available from this site to you, the user, conditioned upon your acceptance of all terms, conditions, policies and notices stated here.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">By visiting our site and/ or purchasing something from us, you engage in our &ldquo;Service&rdquo; and agree to be bound by the following terms and conditions (&ldquo;Terms of Service&rdquo;, &ldquo;Terms&rdquo;), including those additional terms and conditions and policies referenced herein and/or available by hyperlink.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">These Terms of Service apply to all users of the site, including without limitation users who are browsers, vendors, customers, merchants, and/ or contributors of content.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Please read these Terms of Service carefully before accessing or using our website. By accessing or using any part of the site, you agree to be bound by these Terms of Service. If you do not agree to all the terms and conditions of this agreement, then you may not access the website or use any services. If these Terms of Service are considered an offer, acceptance is expressly limited to these Terms of Service.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Any new features or tools which are added to the current website shall also be subject to the Terms of Service. You can review the most current version of the Terms of Service at any time on this page.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We reserve the right to update, change or replace any part of these Terms of Service by posting updates and/or changes to our website.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">It is your responsibility to check this page periodically for changes. Your continued use of or access to the website following the posting of any changes constitutes acceptance of those changes.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Our Website Terms</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">By agreeing to these Terms of Service, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You may not use our products for any illegal or unauthorized purpose nor may you, in the use of the Service, violate any laws in your jurisdiction (including but not limited to copyright laws).</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You must not transmit any worms or viruses or any code of a destructive nature. A breach or violation of any of the Terms will result in an immediate termination of your Services.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Collection</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You can also collect your parcel from our office in Pretoria; (416 Seder, 380 Sisulu Street, Pretoria, South Africa, 0001) from 8 AM - 5 PM on weekdays. Weekends collections are done on arrangements.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Post delivery</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We use the Fastway Couriers to&nbsp;deliver to any valid South African postal address. We will send you a tracking number by email when we dispatch your order and you should receive a post office collection slip about 7-10 days later. You can then collect the parcel from your local post office counter. Postal delivery is R50 on all eligible orders.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Courier</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">This is a door-to-door service. You must supply us with your physical address and someone will need to be available at the address to receive the delivery. Deliveries are made during business hours from Monday to Friday. In main</span><span lang=\"EN-ZA\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN-ZA;\"> centres</span><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">, this will reach you within 5-7 business days of dispatch. Main centres include properties within a 50km radius of the major cities in South Africa. If you are not in the main centre, it may take a few days longer. We do not deliver by courier to plots, farms, mines, military bases, major chain stores, power stations, game reserves and lodges, airports or</span><span lang=\"EN-ZA\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN-ZA;\"> harbours</span><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">, and should your delivery address fall into one of these categories you will be liable for the extra costs incurred in delivering or returning the parcel. We offer delivery of parcels up to 10kg. Delivery on orders over 10kg is calculated based on mass, value, and number of items in the order.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Post delivery</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We use the Fastway Couriers to deliver to any valid South African postal address. We will send you a tracking number by email when we dispatch your order and you should receive a post office collection slip about 7-10 days later. You can then collect the parcel from your local post office counter. Postal delivery is R50 on all eligible orders.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">General Conditions</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We reserve the right to refuse service to anyone for any reason at any time.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You understand that your content (not including credit card information), may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices. Credit card information is always encrypted during transfer over networks.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without express written permission by us.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">The headings used in this agreement are included for convenience only and will not limit or otherwise affect these Terms.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Accuracy, Completeness, and timeliness of information</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We are not responsible if information made available on this site is not accurate, complete or current. The material on this site is provided for general information only and should not be relied upon or used as the sole basis for making decisions without consulting primary, more accurate, more complete or timelier sources of information. Any reliance on the material on this site is at your own risk.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">This site may contain certain historical information. Historical information, necessarily, is not current and is provided for your reference only.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We reserve the right to modify the contents of this site at any time, but we have no obligation to update any information on our site. You agree that it is your responsibility to monitor changes to our site.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">This site may contain certain opinions or beliefs of the author of the website.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=