33333; mso-ansi-language: EN;\">Certain content, products and services available via our Service may include materials from third-parties.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Third-party links on this site may direct you to third-party websites that are not affiliated with us.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We are not responsible for examining or evaluating the content or accuracy and we do not warrant and will not have any liability or responsibility for any third-party materials or websites, or for any other materials, products, or services of third-parties.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We are not liable for any harm or damages related to the purchase or use of goods, services, resources, content, or any other transactions made in connection with any third-party websites.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Please review carefully the third-party\'s policies and practices and make sure you understand them before you engage in any transaction. Complaints, claims, concerns, or questions regarding third-party products should be directed to the third-party.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Users/Subscribers Feedback and Comments</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">If, at our request, you send certain specific submissions (for example contest entries) or without a request from us you send creative ideas, suggestions, proposals, plans, or other materials, whether online, by email, by postal mail, or otherwise (collectively, \'comments\'), you agree that we may, at any time, without restriction, edit, copy, publish, distribute, translate and otherwise use in any medium any comments that you forward to us.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We are and shall be under no obligation (1) to maintain any comments in confidence; (2) to pay compensation for any comments; or (3) to respond to any comments.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We may, but have no obligation to, monitor, edit or remove content that we determine in our sole discretion are unlawful, offensive, threatening,</span><span lang=\"EN-ZA\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN-ZA;\"> libellous</span><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">, defamatory, pornographic, obscene or otherwise objectionable or violates any party&rsquo;s intellectual property or these Terms of Service.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You agree that your comments will not violate any right of any third-party, including copyright, trademark, privacy, personality or other personal or proprietary right.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You further agree that your comments will not contain</span><span lang=\"EN-ZA\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN-ZA;\"> libellous</span><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\"> or otherwise unlawful, abusive or obscene material, or contain any computer virus or other malware that could in any way affect the operation of the Service or any related website. You may not use a false e-mail address, pretend to be someone other than yourself, or otherwise mislead us or third-parties as to the origin of any comments.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You are solely responsible for any comments you make and their accuracy. We take no responsibility and assume no liability for any comments posted by you or any third-party.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Personal Information</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Your submission of personal information through the website is governed by our Privacy Policy. Please view our Privacy Policy.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Errors, Inaccuracies and Omissions</