ate or refresh date applied in the Service or on any related website should be taken to indicate that all information in the Service or on any related website has been modified or updated.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Disclaimer of Warranties; Limitation of Liability</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We do not guarantee, represent or warrant that your use of our service will be uninterrupted, timely, secure or error-free.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">We do not warrant that the results that may be obtained from the use of the service will be accurate or reliable.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You agree that from time to time we may remove the service for indefinite periods of time or cancel the service at any time, without notice to you.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">You expressly agree that your use of, or inability to use, the service is at your sole risk. The service and all products and services delivered to you through the service are (except as expressly stated by us) provided \'as is\' and \'as available\' for your use, without any representation, warranties or conditions of any kind, either express or implied, including all implied warranties or conditions of merchantability, merchantable quality, fitness for a particular purpose, durability, title, and non-infringement.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">In no case shall New Chapter Bookstore, our directors, officers, employees, affiliates, agents, contractors, interns, suppliers, service providers or licensors be liable for any injury, loss, claim, or any direct, indirect, incidental, punitive, special, or consequential damages of any kind, including, without limitation lost profits, lost revenue, lost savings, loss of data, replacement costs, or any similar damages, whether based in contract, tort (including negligence), strict liability or otherwise, arising from your use of any of the service or any products procured using the service, or for any other claim related in any way to your use of the service or any product, including, but not limited to, any errors or omissions in any content, or any loss or damage of any kind incurred as a result of the use of the service or any content (or product) posted, transmitted, or otherwise made available via the service, even if advised of their possibility.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Because some states or jurisdictions do not allow the exclusion or the limitation of liability for consequential or incidental damages, in such states or jurisdictions, our liability shall be limited to the maximum extent permitted by law. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; mso-outline-level: 4; margin: 15.0pt 0in 7.5pt 0in;\"><span lang=\"EN\" style=\"font-size: 18.0pt; font-family: Roboto; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Entire Agreement</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">The failure of us to exercise or enforce any right or provision of these Terms of Service shall not constitute a waiver of such right or provision.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">These Terms of Service and any policies or operating rules posted by us on this site or in respect to The Service constitutes the entire agreement and understanding between you and us and govern your use of the Service, superseding any prior or contemporaneous agreements, communications, and proposals, whether oral or written, between you and us (including, but not limited to, any prior versions of the Terms of Service).</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify;\"><span lang=\"EN\" style=\"font-size: 10.5pt; font-family: Roboto; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Helvetica; color: #333333; mso-ansi-language: EN;\">Any ambiguities in the interpretation of these Terms of Service shall not be construed against the drafting party.</span></p>\r\n</div>', 'terms-of-service', 1, '2019-03-20 09:30:19', '2019-08-09 06:41:59', '', '', ''),
(5, 'Manuscript Submissions', '<p><strong>Submission Process: </strong></p>\r\n<p>&nbsp;</p>\r\n<p>Thank you for your interest to work and partner with us! <br /><br />We are looking forward to reading your manuscripts with the hope to work with you&hellip;.</p>\r\n<p>&nbsp;</p>\r\n<p>Currently, we are receiving a high volume of submissions, and at the same time, we want to give your work the consideration it deserves! &nbsp;Therefore, because we are a small team, it can 1 &ndash; 2 months for us to be able to give you comprehensive feedback about the way forward.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Please be patient while we give your work the attention it needs.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>How to *submit a manuscript:</strong><strong><br /></strong><br />What we need from you as part of the manuscript:<br /><br />1. A cover page with the following details:</p>\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Your full name and surname</li>\r\n<li>Your contact details - email and cell number</li>\r\n<li>A short biography of who you are (max 500 words)</li>\r\n<li>A short synopsis of the manuscript (max 500 words)</li>\r\n<li>A list of previous publications if applicable</li>\r\n<li>A complete manuscript in word or pdf format</li>\r\n<li>All manuscripts must be spell checked before submission.</li>\r\n</ol>\r\n<p>If you do not have a full manuscript, do not worry! You may submit the first 3 chapters of your book. <br /><br /><br /><strong>Where to send your manuscript:<br /></strong><br />Please ** all manuscripts must be submitted via the system <a href=\"../../login-register\">https://helpmyworldpublishing.co.za/login-register</a></p>\r\n<p>*Only manuscripts that are uploaded on the system will be considered*<br />*It is easy, register as an author, upload your manuscript and then track the progress of your manuscript*</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Good Luck and Best Wishes,</strong></p>\r\n<p><strong>The Helpmyworld Team</strong></p>\r\n<p>* Submissions that do not comply with these guidelines will not be considered.</p>\r\n<p>** Email support is available.</p>\r\n<p>&nbsp;</p>', 'manuscript-submissions', 1, '2019-04-06 19:23:17', '2019-05-21 10:48:34', '', '', ''),
(8, 'Hosting', '<h3>Web Development And Design</h3>\r\n<div class=\"dresses\">\r\n<div class=\"container\">\r\n<div class=\"w3ls_dresses_grids\">\r\n<div class=\"col-md-12 w3ls_dresses_grid_right\">\r\n<div class=\"col-md-3 w3ls_dresses_grid_right_left\">\r\n<h3>eCommerce or online store</h3>\r\n<div class=\"w3ls_dresses_grid_right_grid1\"><img class=\"img-responsive\" src=\"http://localhost:8000/public/images/75.png\" alt=\" \" /></div>\r\n</div>\r\n<div class=\"col-md-3 w3ls_dresses_grid_right_left\">\r\n<h3>Web Development</h3>\r\n<div class=\"w3ls_dresses_grid_right_grid1\"><img class=\"img-responsive\" src=\"http://localhost:8000/public/images/74.png\" alt=\" \" /></div>\r\n</div>\r\n<div class=\"col-md-3 w3ls_dresses_grid_right_left\">\r\n<h3>Android, Windows &amp; iOS Apps</h3>\r\n<div class=\"w3ls_dresses_grid_right_grid1\"><img class=\"img-responsive\" src=\"http://localhost:8000/public/images/40.jpg\" alt=\" \" /></div>\r\n</div>\r\n<div class=\"col-md-3 w3ls_dresses_grid_right_left\">\r\n<h3>Cloud &amp; Shared Hosting</h3>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'hosting', 1, '2019-04-17 13:56:34', '2019-04-17 13:56:34', '', '', '');
INSERT INTO `cms_pages` (`id`, `title`, `description`, `url`, `status`, `created_at`, `updated_at`, `meta_title`, `meta_description`, `meta_keywords`) VALUES
(7, 'Special Promotion', '<div id=\"contact-page\" class=\"container\">\r\n<div class=\"bg\">\r\n<div class=\"w3ls_about_grids\">\r\n<div class=\"col-md-6 w3ls_about_grid_left\">\r\n<div id=\"contact-page\" class=\"container\">\r\n<div class=\"bg\">\r\n<div class=\"w3ls_about_grids\">\r\n<h1 style=\"text-align: left; padding-left: 120px;\"><strong style=\"font-size: 11px;\">SOMETHING SPECIAL FOR EVERYONE</strong></h1>\r\n<div class=\"col-md-6 w3ls_about_grid_left\"><br />\r\n<p style=\"text-align: left;\">We understand that not everyone has liquid cash ready to pay for all the needed works to get their books published. This endless special deal is designed for people who cannot afford or who are struggling to afford all the publishing costs.</p>\r\n<p style=\"text-align: left;\">We offer very low monthly premiums - most affordable to contribute to the overall publishing project</p>\r\n<p style=\"text-align: left;\">Premium rates never increase!</p>\r\n<p style=\"text-align: left;\">Cover ALL publishing costs!</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">Thanks to our growing community and the partnerships we nurture, we&rsquo;re able to offer you multiple membership choices so you can choose what works best with your lifestyle and budget.</p>\r\n<p style=\"text-align: left;\">At all levels, you can enjoy access to unique publishing experiences and take advantage of Helpmyworld Publishing exclusive prices.</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; padding-left: 120px;\"><strong>MEMBERSHIP LEVELS</strong></p>\r\n<p style=\"text-align: left; padding-left: 120px;\">*All manuscripts are subject to assessment to qualify for the below packages*<br /><br />* These packages are not designed for manuscripts under the following categories*<br /><br />&nbsp; - Poetry<br />&nbsp; - Short stories</p>\r\n<p style=\"text-align: left; padding-left: 120px;\">*If your manuscript falls under the above-mentioned categories. Be prepared to bear all the publication costs.*</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"w3l_related_products\" style=\"text-align: center;\">\r\n<div class=\"container\">\r\n<table style=\"height: 13px; width: 72%; border-collapse: collapse; border-style: none; float: left;\" border=\"0\">\r\n<tbody>\r\n<tr style=\"height: 13px;\">\r\n<td style=\"width: 379px; height: 13px;\">\r\n<div style=\"text-align: left;\">\r\n<h3 style=\"text-align: left;\">Jadeite</h3>\r\n<h5 style=\"text-align: left;\">Editing</h5>\r\n<h5 style=\"text-align: left;\">Book Cover and Layout</h5>\r\n<h5 style=\"text-align: left;\">ISBN and Barcode</h5>\r\n<h5 style=\"text-align: left;\">EBook on Amazon</h5>\r\n<h5 style=\"text-align: left;\">Sales and advertising on <br />Helpmyworld online store</h5>\r\n<h5 style=\"text-align: left;\">Printing 30 Copies</h5>\r\n</div>\r\n<br />\r\n<div class=\"simpleCart_shelfItem\" style=\"text-align: left;\">&nbsp;</div>\r\n<div class=\"simpleCart_shelfItem\" style=\"text-align: left;\">&nbsp;</div>\r\n<div class=\"simpleCart_shelfItem\" style=\"text-align: left;\">&nbsp;</div>\r\n<div class=\"simpleCart_shelfItem\" style=\"text-align: left;\">\r\n<h2 style=\"text-align: left;\">&nbsp;</h2>\r\n<h2 style=\"text-align: left;\">R570</h2>\r\n<p style=\"text-align: left;\"><a class=\"item_add\" href=\"../../contact\">Sign Up</a></p>\r\n</div>\r\n</td>\r\n<td style=\"width: 186px; height: 13px;\">\r\n<div>\r\n<h3 style=\"text-align: left;\">Musgravite</h3>\r\n<h5 style=\"text-align: left;\">Editing</h5>\r\n<h5 style=\"text-align: left;\">Book Cover and Layout</h5>\r\n<h5 style=\"text-align: left;\">Author&rsquo;s one-page website</h5>\r\n<h5 style=\"text-align: left;\">ISBN and Barcode</h5>\r\n<h5 style=\"text-align: left;\">EBook on Amazon</h5>\r\n<h5 style=\"text-align: left;\">Sales and advertising on Helpmyworld online store</h5>\r\n<h5 style=\"text-align: left;\">Printing 50 Copies</h5>\r\n</div>\r\n<div class=\"simpleCart_sh