(11, 'Publishing FAQ', '<p style=\"text-align: justify;\">FREQUENTLY ASKED QUESTIONS</p>\r\n<table style=\"width: 775px;\" width=\"0\">\r\n<thead>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>QUESTION</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p><strong>SHORT ANSWER</strong></p>\r\n</td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Should I self-publish my book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Only if you are sure that you can fulfil all the roles of a publisher without sacrificing quality. Or if you can&rsquo;t find a publisher interested in publishing your book.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Should I publish a printed book or an eBook?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Very often the answer is to publish both &ndash; but it does depend on the production specifications of your book and the market you are trying to reach.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Can I publish an eBook with one publisher and the print book with another publisher?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>It depends on the terms of your contract, but not usually.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Should I publish an eBook instead of a print book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Only if the market you are targeting wants an eBook and not a print book.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>How do I know which is the right publisher to approach?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Find out whether they are active in the market your book is aimed at &ndash; look at their website and their other published titles in bookshops to find this information.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What is the best way to approach a publisher?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Use a written proposal submitted by email (check the publisher&rsquo;s website for guidelines on submissions).</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Do I need an agent?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Only if you want to get published in the UK and US.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Does a book need to be registered somewhere?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>No. All you need is an ISBN (International Standard Book Number), which your publisher will get from the State Library.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Can you use the same ISBN for the print book and the eBook?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>No, each format needs its own ISBN.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Does copyright protect ideas?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>NO.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>How does publishing contract work?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Like any contract: it imposes legal obligations on both parties. In this case, the author has to deliver a manuscript; the publisher has to publish and market the book at her cost.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>How long should I wait once I have submitted my manuscript before I phone the publisher?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>A month.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>How long will it take from the time I deliver my manuscript to publication?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Nine months, on average. We do it in four and a half months.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>How many copies does the average book in South Africa sell?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>2000-3000 copies are seen as an average success.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>If I use a publisher, who controls the copyright?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>The publisher, but it normally reverts to you when the book goes out of print.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Should I bring my manuscript in personally and wait for an editor to see me so that I can explain the plot or contents face to face?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>No &ndash; please send an email with all the necessary information. View our submissions process.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Should I share my ideas with a publisher - won\'t he steal it?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Generally, a publisher will not steal your ideas. None the less do not simply share an idea &ndash; write something first, and submit via the channels the publisher uses.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Should I use colour in my book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>It is much more expensive but of course, some books demand it by their very nature.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What discounts do booksellers get?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>For trade (general) books, about 47%; for educational books discount is lower.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What is a backlist book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>A book that has been around for more than a year.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What is a frontlist book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>A new book.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What is a reasonable royalty percentage?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>10 - 12% of net receipts (the amount the publisher sells to the bookseller for, i.e. retail price less VAT less discount), but it varies depending on the publisher, type of book, and the leverage you have. And in our case what you have contributed financial to the book.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Are eBook and print book royalties the same?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>No, in many cases the eBook royalty is higher than the print book royalty to compensate for the absence of printing costs.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>How often are royalties paid?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Once or twice a year, in arrears for sales of the previous period.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What is a trade book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>A book for the consumer market.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What other types of books are there?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Publishers define books by the main markets that they sell in &ndash; trade (children &amp; adult), religious, schools/educational, tertiary education/academic, TVET college, scholarly, professional &ndash; not all publishers publish for all markets</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What is an imprint?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>It is a trade name or brand or logo, like Penguin or Juta.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What kind of style should I follow in the book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Use a style guide in a consistent way, either a general one like the Oxford Style Manual or one provided by the publisher.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>What software should I use for writing my book?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Microsoft Word</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>When and how can I get the rights to my book back from the publisher?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>After the book goes out of print and there are no plans of reprinting.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>When do I need copyright permission?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>When quoting a substantial portion of another work.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Where does one get ISBN numbers?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>The State Library.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Which people in a publishing house do I deal with?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>Mainly the commissioning editor.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 358px;\">\r\n<p><strong>Who owns the copyright?</strong></p>\r\n</td>\r\n<td style=\"width: 410px;\">\r\n<p>The author, unless he cedes the copyright.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', 'publishing-faq', 1, '2019-04-22 09:09:37', '2019-09-16 12:44:43', '', '', '');
