(13, 'The Beebo WILFRED B. THEMBA S Y N O P S I S Booklet COMMUNICADOR', 'The_Beebo_WILFRED_B._THEMBA_S_Y_N_O_P_S_IS_Booklet_COMMUNICADOR06-24-2019_0205pm.doc', 'Rejected', 50, '2019-06-24 12:05:23', '2019-07-04 10:57:31', '', NULL, NULL, 0, NULL),
(9, 'Legacy of a Rain Queen', 'Legacy_of_a_Rain_Queen05-26-2019_1021am.docx', 'Book Cover', 28, '2019-06-12 22:00:00', '2019-09-18 04:48:26', '', 'Your book is well written.<br />\r\n<br />\r\nThese are the costs attached to publishing. You have options to publish your manuscript.<br />\r\n<br />\r\nEditing and Proof reading: R9000 at 15 cents per word<br />\r\nBook Cover and layout and design: 7200<br />\r\nPritning 50 copies: 3500', 19700.00, 0, NULL),
(11, 'I want my Scars to count for Something', 'I_want_my_Scars_to_count_for_Something06-08-2019_0433pm.docx', 'Book Cover', 36, '2019-06-08 14:33:29', '2019-09-18 04:48:37', '', 'You will make the first payment on the 15th or any day of your choice from then. Will initiate the payment system when you are ready.<br />\r\n<br />\r\nWe will start with work immediately thereafter.', NULL, 0, NULL),
(14, 'ANTHOLOGY BROWNDUSTS M A V E R I C K E R Y a DewDROPS After SALIVAS && URINESEXTRETA  2019YCC', 'ANTHOLOGY BROWNDUSTS M A V E R I C K E R Y a DewDROPS After SALIVAS && URINESEXTRETA  2019YCC06-27-2019_0111pm.doc', 'Rejected', 50, '2019-06-27 11:11:15', '2019-07-04 10:57:54', '', NULL, NULL, 0, NULL),
(15, 'manusrcript \"THE ESCAPE FROM THE RURAL CAGE\"', 'manusrcript_\"THE_ESCAPE_FROM_THE_RURAL_CAGE\"06-28-2019_0946am.pdf', 'Accepted', 53, '2019-06-28 07:46:23', '2019-07-01 09:28:14', '', 'We won\'t be able to publish your book under our packages.<br />\r\nWe can help you self publishing by providing you with services.<br />\r\nEditing and Proofreading: R6000<br />\r\nBook Cover, Layout and Design and Typesetting: 7200<br />\r\nPrinting 5x8 size, 50 Copies: R3500<br />\r\n<br />\r\nAbove are the costs to take the self-publishing route.', 16700.00, 0, NULL),
