(2, 0, 'Join Us: Book Launch Mbulaheni Rhona Luphai', '1550078500.jpg', '<p>Join us for an exciting book launch for Mbulaheni Rhona Luphai. The day will be packed with great individuals from all spheres of life and professions. We will have Rorisang Maimane, author of Embrace Change: Flourish in times of challenges and crisis as our guest speaker.</p>\n<p>Refreshments and lunch will be served while you enjoy the spirit of socializing and building new relationships with entrepreneurs, authors, artists and more.</p>\n<p>Come join us on the 2nd March 2019 at 10:00.</p>', 'join-us-book-launch-mbulaheni-rhona-luphai', '2019-02-13 15:21:41', '2019-07-25 08:09:55', 'Blog', 1, 1),
