(13, 0, 'Two important things to consider before designing your book cover', '1567692060.jpg', '<p> </p>\n<p>I know they say do not judge a book by its cover but as an author your book must be able to attract readers’ attention by just looking at its cover design. Potential book buyers often look at the cover design first then the book summary at the back, but if the cover design is not attractive the reader will not bother reading the summary.</p>\n<p>If your cover design is dull you will lose a lot of potential buyers for your book because it is not attractive even if its content is a good read. Potential buyers will think the books’ content is just as dull as it covers’ design.</p>\n<p>So go for something that is attractive and simple but make sure it’s not something obvious. Don’t be afraid to do something risky with your book cover design.</p>\n<p>When choosing the cover art designs look at your target audience, the contents of the book and its size.</p>\n<p>Tip #1 Find an experienced book cover designer</p>\n<p>Remember to do background check on the designer and do reference on him/her, this will help you to choose the best designer for your book. Do not settle for the first designer you meet but look for other options and explore them before making a decision.</p>\n<p>Do not be afraid to spend money on the cover, sometimes cheap is not the best way to go. So you will get for what you paid for.</p>\n<p>Tip #2 Brainstorm book cover design ideas</p>\n<p>Once you have chosen a designer to do the cover of your book, explain clearly what you want for your book cover to the designer. Do not be afraid that the designer will criticize your ideas; remember that it will be your book that’s on the shelves with your name on it.</p>\n<p>When brainstorming ideas for the book cover consider the type of typography you want to use, go for the type of a typography that is easy to read and attractive. Lastly decide if you want to use photographs or illustrations.</p>\n<p>Remember to avoid clutter in your design, keep it simple yet attractive and unique.</p>\n<p><strong>By Tebogo Moleya</strong></p>', 'two-important-things-to-consider-before-designing-your-book-cover', '2019-09-05 12:01:01', '2019-09-05 12:01:01', 'Blog', 1, 5),
