(15, 0, 'Man makes plans. God laughs', NULL, '<p>2018 - 2019 was a year of many endings for me. I picked to close doors. I severed friendships that didn’t serve me. I walked away from bad eating habits. I watched less news. I walked away from jobs were a strain and stress (I was so sick my body was shutting down). I walked away from accumulating nonsense – all in the name of being on-trend.</p>\n<p>Instead, I walked towards spending time doing the things I most enjoy like reading, hiking, having a glass of wine in my garden while watching bees and ladybugs go about their business. I cried a lot – refreshing, cleansing tears - ousting years and years of repressed emotions. I wrote and wrote. I talked less and prayed more. I met my ancestors.  It was a refreshing change of pace. I was secluded. I was at peace. I was not sickly anymore.  </p>\n<p>It was quiet – still – self-contained.</p>\n<p>Still, some thing’s that ended were not of my choosing at all. For instance, even though I said no to what I did not want – what I wanted also didn’t come.</p>\n<p>I wanted to write – then publish – at the same time find work at a theatre or gallery or NGO, maybe open a quaint healing store – a vocation that would either stimulate me creatively or else allow me to use my skills to help people. I had quite a neat little plan…. But nothing came. Nothing!</p>\n<p>This was shocking to me. I have always had it so easy. I have always had a script that goes according to plan. But not this time. The work I sought I didn’t find. My bank account dwindled. I was grappled with a different kind of stress. What if I made a big mistake? What if I imagined my talents and they’re not there at all?</p>\n<p>This new beginning feels more like painful ending - a slow slow slow death. And…. Maybe it is. Maybe that part of me had to die.</p>\n<p>It is 2019 now and I am still in transition. I am still writing. I am still praying to be published. I am still trusting to find some work that uses my skills while being of some help to someone.</p>\n<p>And even with the consideration that I am not completely over the bridge – with some hindsight, I understand why I have been through this.… I needed reflection.  I really needed to be alone (to think of who I was and who I am becoming). I really needed to be broke (because I needed some humbling if only to appreciate what is to come next). I needed to sit outside and take long walks (observe how in one day, never mind a lifetime, there can be many seasons). I needed to be positioned so that the things not meant for me may fall away (and that the blessings in store for me may find their rightful place my life).</p>\n<p>Marion Woodman said “There comes a time in your life, when you know that the life you have been living is over, and you don’t have a clue who you are becoming.”</p>\n<p>It’s Spring 2019. I know my life before is over and its only use will be reflective writing material; I have an idea of who I want to be - yet no clue of how this new woman will unfold. Because if there is anything I learnt it is that “man makes plans. God laughs.”</p>\n<p>Indeed we make these plans for our lives. And we should. But God also has His own thinking. His own way of ensuring that the plans we make are also within the guidelines of His timing and our ripeness. I needed to mature. I needed to think…. Think about things like - is this what I really want? And if I got what I wanted tomorrow – would I appreciate it? Would I honour it?</p>\n<p>Three years ago my answers would have been different. In fact, questions like this would possibly have not crossed my mind. Today – any small success granted, I accept with so much openness and gratitude and humility. Every small feat is a blessing.</p>\n<p>So I will continue to write. I will continue to want to publish. I will take up photography again and I will build a new life…. I have every reason to hope and believe that all will turn out well. After all; last December I had my first published piece in US literary publication called Threaded Masquerade and I joined the Helpmyworld team….. and so it begins.</p>\n<p><strong>Twitter: @KeituReid</strong></p>', 'man-makes-plans-god-laughs', '2019-09-11 16:38:39', '2019-09-11 16:38:39', 'Blog', 1, 1),
