(19, NULL, 'Do we really have to know?', NULL, '<p><strong>First Published in Threaded Masquerade – US Literary Journal</strong></p>\n<p> </p>\n<p>How long do you need to know someone until you have made up your mind that they are all you will need.</p>\n<p>A second….Maybe, if all you need to be jubilant is to know their name.</p>\n<p>An hour….Perhaps, if you need to know their study or where they chose to live.</p>\n<p>A day….Possibly, if all you need to feel affection, is to know of their relatives and the strength of their</p>\n<p>last name.</p>\n<p>A week…. I guess if all you need to know to desire their heart is knowledge of the contours of their face</p>\n<p> and the small of their back.</p>\n<p>How long does it really take.… A month.… A year…. A decade….</p>\n<p> </p>\n<p>For you can know their name but may never know what call they answer to.</p>\n<p>Do they answer to the call that says, “More than the letters that make up who I am;</p>\n<p>I turn when I hear a pitch that says you need me to stay and share this moment with you”.</p>\n<p> </p>\n<p>You may know of their studies; but have they been experienced by the discipline of life;</p>\n<p>the one that teaches you that books bring much knowledge but nothing to the counter of wisdom. </p>\n<p>The words from literary documents and scripts are noteworthy and should be considered as part of the course.</p>\n<p>Yet alone, they are nothing if one has not lived.</p>\n<p>Since through life, they may have picked up teachings on how to care for you delicately.</p>\n<p> </p>\n<p>You may know their surname and their history;</p>\n<p>but without understanding their thoughts of their own future you have no idea at all who they</p>\n<p>want to be or where they want to go….. Importantly, where they want to take you.</p>\n<p> </p>\n<p>You can know the feel of their body and the flavour of their kiss.</p>\n<p>You may have toured the contours of their face and felt the dip in the small of their back.</p>\n<p>However soon you will realise that the discovery of these contours means you have known this body,</p>\n<p>but only for today.</p>\n<p>For these contours change – and the dips shift. </p>\n<p>Accepting this will be a lifelong expedition which challenges you to not be afraid;</p>\n<p>but more excited that this person’s state of mind is advancing and their form is collaborating</p>\n<p>with the evolution of a soul.</p>\n<p> </p>\n<p>So...</p>\n<p>Does accumulated knowledge through time tell if you will be devoted to someone or not?</p>\n<p>Question. </p>\n<p>What does time tell but facts which are presented by inconsistent mouths.</p>\n<p>Because with time you can accumulate a wealth of data and statistics about this being.</p>\n<p>Time could engage you in a game of sorts where we all are players seeking truth in each other.</p>\n<p>You can weigh up the advantages and disadvantages like a mathematical equation.</p>\n<p>Eliminate the risk because it has been defined in this way.</p>\n<p>It has been taught that these things lead to secure love.</p>\n<p>To know the name. To know the family. To know the school. To know the past….</p>\n<p> </p>\n<p>Dare we believe that it is possible to be able to equate the sound of a heart beating harder</p>\n<p>than it ever has with a more immediate prophecy.</p>\n<p>An urge that says “this is the one despite the fact that I do not know their last name”.</p>\n<p>Dare we believe it is possible that the eye can catch on to something and love just for loves sake.</p>\n<p>Dare we believe that we do not really have to know the facts that in many instances can be removed;</p>\n<p>while the soul cannot be removed.</p>\n<p>The soul is open to you when you are willing to see.</p>\n<p>The soul is eternal; it remains long after the last word has been spoken, and the last fact presented.</p>\n<p> </p>', 'do-we-really-have-to-know', '2019-09-21 17:55:43', '2019-09-21 17:55:43', 'Blog', 1, 2),
