(22, NULL, 'Writing ideas and literary genres', NULL, '<p>It is often said that writing is too complicated; well it is but not that hard. You just need to know what to write about and what type of literary genre you want to venture into.</p>\n<p> A literary genre is defined as a style of writing. There are different types of writing genres such as fiction, and non-fiction. However, there are sub-classifications to those writing genres like romance, comedy, horror, and fantasy just to mention a few.</p>\n<p>According to an article published on April 2019 by News24 by Beth le Roux, non-fiction books dominate bestseller lists in South Africa.</p>\n<p>That means if you want to write a book and become one of the bestselling authors you might as well venture into non-fiction.</p>\n<p>Non-fiction can be anything from politics to real-life stories but in South Africa, topical books sell better. For example; the “Gangster State” by investigative journalist Pieter Louis Myburgh is one of the books that got South Africa talking but that’s not all non-fiction have the potential to dominate, I mean who can forget the famous book series “Hlomu the Wife” by Dudu Busani. The book series did well and it is pure fiction.</p><p>\n<span style=\"color:#808080;\"><strong>What to write [about]</strong></span>\n</p>\n\n<p>• Romance</p>\n<p>• Children’s books</p>\n<p>• Politic/poverty/socio-economic issues/fashion and makeup/health etc.</p>\n<p>• Memoirs</p>\n<p>• Crime/mystery/thriller</p><p>\n<span style=\"color:#808080;\"><strong>Romance</strong></span>\n</p>\n\n<p>Remember that people read books mostly to escape their realities and to get lost in a world that they can fantasies about all day long. So when writing about romance it must be fiction, create those fictional characters that will make people addicted to your book.</p>\n<p>We all know that relations are showing us flames so why write a book to remind us how miserable we are in relationships? So why not write a book about a fictional romantic love story between two lovers who made it against all odds?</p>\n<p>Make sure the love story is not too obvious, be creative and get lost in your own thoughts. Remember that not all love stories deserve a happy ending. </p><p>\n<span style=\"color:#808080;\"><strong>Children’s books</strong></span>\n</p>\n\n<p>Children’s books usually focus on fiction storytelling like fairytales, they use very simple langue and are very short.</p><p>\n<strong><span style=\"color:#808080;\">Memoirs</span></strong>\n</p>\n\n<p>The purpose of a memoir is to show how events led to the change of the author on a particular issue or life in general. It can provide educational moments.</p><p>\n<span style=\"color:#808080;\"><strong>Crime/thriller/mystery</strong></span>\n</p>\n\n<p>This type of writing can be fiction or non-fiction it deals with crimes, warning signs/detection, criminals and their motives of committing hideous crimes.</p>\n<p>Often a crime book is written when the perpetrator is arrested or has died. The structure of crime books includes the crime that took place it is usually a murder, then it goes to the investigation part and ends with an outcome which can be the arrest of the perpetrator.</p>\n<p>As I have said in the introduction, crime books can be fiction or non-fiction for example; The Stranger Beside Me by Ann Rule is a true crime (non-fiction) book story. The story is about the charming Ted Bundy who was a serial killer; surprisingly he was a co-worker of Rule.</p><p>\n<span style=\"color:#808080;\"><strong>Final word</strong></span>\n</p>\n\n<p>When it comes to writing do not limit yourself, find your tune first then dance to it. I just gave you some ideas on what to write about but there are tons of things you can write about.</p>\n<p>“Write what you know and what you feel at the moment”- Rorisang Maimane author of “Embrace Change,” he said not everything you know and feel can turn into something spectacular but note it down you can never know where it might lead too.</p>\n<p>You don’t have to write a book to be an author you can write short stories, dramas, poems, motivations, and many other things. Do not put pressure on yourself because you do not use big words in your writing, be simple yet unique. NB: Big words do not mean good writing.</p>\n<p> </p>\n<p> </p>', 'writing-ideas-and-literary-genres', '2019-10-07 07:11:50', '2019-10-07 07:11:50', 'Blog', 1, 5),
