(26, NULL, 'Word choices part 1', NULL, '<p>In the previous blog post, I said you do not have to use big words in your writing to be called a good writer. Truth is you need to be a smart writer before you can be called a good writer. Some words are too obvious and dull; that is why it is important to invest time in your writing and use synonyms instead. As a writer do not be predictable.</p>\n<p><br><span style=\"color:#808080;\"><strong>Words to use instead of \"obvious and dull words\"</strong></span></p>\n<p><br><span style=\"color:#ff0000;\">Very serious</span>-<span style=\"color:#008000;\"> grave</span><br>You made a very serious mistake.<br>Rather say: You made a grave mistake.</p>\n<p><br><span style=\"color:#ff0000;\">Excited</span>- <span style=\"color:#008000;\">thrilled</span><br>Thato is excited about the outing.<br>Rather say: Thato is thrilled about the outing.</p>\n<p><br><span style=\"color:#ff0000;\">Smile</span>- <span style=\"color:#008000;\">grin</span><br>Her smile is breathtaking.<br>Rather say: Her grin is breathtaking.</p>\n<p><br><span style=\"color:#ff0000;\">Big</span>- <span style=\"color:#008000;\">tremendous</span><br>It was a big event</p>\n<p>Rather say: It was a tremendous event</p>\n<p><span style=\"color:#ff0000;\">Confident</span>- <span style=\"color:#008000;\">unruffled</span><br>He was confident<br>Rather say: He was unruffled about the whole thing</p>\n<p><br><span style=\"color:#ff0000;\">Beautiful</span>- <span style=\"color:#008000;\">drop-dead gorgeous</span> <br>Elaine is beautiful<br>Rather say Elaine is drop-dead gorgeous</p>\n<p><br>There are many words that you can use, if you are not sure which word to use just look for its synonyms. I will post word choices part 2 that are commonly used by writers.</p>', 'word-choices-part-1', '2019-10-19 08:10:40', '2019-10-19 08:34:00', 'Blog', 1, 5),
(28, NULL, 'Word choices Part 2', NULL, '<p>Ever felt like the word you used is wrong? Well, finding the right words for your writing can be challenging, more especially if you are clueless on where to start. There are synonyms that you can use for better word choices but make sure they blend in with your story.  For better word choices use the dictionary or just look up the internet for synonyms. Below are examples of some of the word choices you can use.</p><p>\n<span style=\"color:#808080;\">Ran</span>\n</p>\n\n<p>Bolted, Sped or sprinted</p><p>\n<span style=\"color:#808080;\">Find</span>\n</p>\n\n<p>Uncover, Discover or Pinpoint</p><p>\n<span style=\"color:#808080;\">Small</span>\n</p>\n\n<p>Petite, Teeny or Tiny</p><p>\n<span style=\"color:#808080;\">Old</span>\n</p>\n\n<p>Ancient, Mature or Aged</p><p>\n<span style=\"color:#808080;\">Blow</span>\n</p>\n\n<p>Gust, Puff or Blast</p><p>\n<span style=\"color:#808080;\">Dust</span>\n</p>\n\n<p>Dirt, Smut or Soot</p>\n<p>Always pay attention to the kind of words you use, don’t use synonymous for the sake of it but use words that will make it easier for your readers to understand. Remember not to use big words and words that don’t blend with your story. Keep it simple and real.</p>', 'word-choices-part-2', '2019-10-30 09:27:21', '2019-10-30 09:36:04', 'Blog', 1, 5),
(29, NULL, 'Types of introductions to choose from when writing a book', NULL, '<p style=\"text-align:justify;\">An introduction is the most important part of your writing because it\'s usually the first thing people read. If it is boring then believe or not; people will not read it. See introduction as being given 60 seconds to sell your product with no second chances. You will give it your all right? Alright, when doing a presentation the first thing that attracts people is the way you dressed right? That dressing part, in this case, is your book cover. Secondly, the way you introduce yourself is the introduction to your book.</p>\n<p><img src=\"https://helpmyworldpublishing.co.za/laravel-filemanager/photos/165/Self-Introduction-Essay-1200x675.jpg\" alt=\"\" width=\"400\" height=\"225\"></p>\n<p><strong>Different types of introductions </strong></p>\n<p><strong>A suspense/question introduction</strong></p>\n<p>This type of introduction is like a mystery. This introduction wants you to leave your readers puzzled and left with many questions. You can ask a question that is strange and will leave readers scratching their heads. An example of suspense<br>\"The ancient spiritual could have been the theme song of the united states in 1957. We were a-moverin\' to, fro, up, down and often in concentric circles.</p>\n<p><br><strong>Descriptive introduction</strong></p>\n<p>You describe the mood, scene, and surroundings. This type of introduction allows you to set the mood for the reader; it\'s like hooking your readers to your book. Be very descriptive and your readers will feel like they are part of the book and there physically. Just to give you an idea on what I\'m talking about, here\'s a descriptive introduction from Rebone Thibedi-Mogotsi\'s book \"A woman Wronged\"</p>\n<p><br>\"‘Honey, I\'m home.\'<br>Maxwell Richardson\'s deep, husky voice preceded him as he burst into the kitchen of his lavish two-storey home. His heavy briefcase dangled from his right hand, causing him to falter as he made his way to the table in the center of the room. An enormous man he was, both in height and girth. His stature befitted his position as a renowned High Court Advocate.\"</p>\n<p><br><strong>Fun fact/ stats</strong></p>\n<p>This type of introduction is mostly used in marketing. You can use a fun fact or a statistic to grab the reader\'s attention, find the most interesting fact or stats about the topic you are writing and present it to the readers.</p>\n<p><br><strong>Narration</strong></p>\n<p>Here you tell a story with detailed facts. An example of a narration introduction taken from the Gangster State: Unravelling Ace Magashule\'s Web of Capture book by Pieter-Louis Myburgh.</p>\n<p><br>\"One Friday evening in mid-2013 my cellphone rang just as I was about to put a few takeaway pizzas in my car. I had been working at a Sunday newspaper in Johannesburg and it was not unusual to get work-related calls over the weekend.\"</p>\n<p><br><strong>Quote</strong></p>\n<p>Start with a quote that is powerful and can attract a reader\'s attention in an instant. As long as it is relevant to what you are writing. The next post will be about types of conclusions and how to write them.</p>\n<p> </p>', 'types-of-introductions-to-choose-from-when-writing-a-book', '2019-10-30 15:57:15', '2019-11-12 11:23:34', 'Blog', 1, 5),
(31, NULL, 'The Sitholes Succeeding Together Within The Struggle', NULL, '<p><img src=\"https://helpmyworldpublishing.co.za/laravel-filemanager/photos/165/The%20Sitholes_cropped_1573563143.jpeg\" alt=\"\" width=\"400\" height=\"300\"></p>\n<p> </p>\n<p>With their first book launched earlier this month, Siyabonga and Lindiwe Sithole authors of Succeeding Together Within the Struggle cannot wait for their second book to be published.</p>\n<p><br>Succeeding Together Within the Struggle is a book about marriage; its challenges and ways to overcome them.</p>\n<p>It highlights issues that almost each and every married couple goes through.</p>\n<p><br>One of the important points in the book is to show couples that whatever they may be facing may be much better compared to what other couples pray together to make their marriage work and to be stronger.</p>\n<p><br>“Without God, we wouldn’t be having gone through all that we did. We have and still find ourselves on each other’s side and still going strong,”</p>\n<p><br>“Inviting God in our marriage made us who we are right now,” said the couple.</p>\n<p><br>“Initially the book was supposed to be about us as a couple but later it became a self-development book. That encourages people to hold on when faced with marital problems and fix things with their partners,” they added.</p>\n<p><br>Siyabonga and Lindiwe met in 2014 but tied the knot in 2017, they started writing the book back in 2016 after their followers on social media encouraged them to have their own TV show but they thought that it would be better if they write a book instead. It took them three years to complete it.</p>\n<p><br>Anyone who would like to buy the book can go onto www.helpmyworldpublishing.co.za or email the couple on iamlindiwemajola@gmail.com or siyabonga.cyabongagmail.com.</p>', 'the-sitholes-succeeding-together-within-the-struggle-1', '2019-11-12 11:10:11', '2019-11-12 11:15:41', 'Blog', 1, 5),
(32, NULL, 'Life on Stilettos: Real stories of survivors of gender-based violence', NULL, '<p style=\"text-align:justify;\"><img src=\"https://helpmyworldpublishing.co.za/laravel-filemanager/photos/165/IMG-20190913-WA0000.jpg\" alt=\"\" width=\"390\" height=\"390\"></p>\n<p>Gender based violence has been making headlines throughout the year in South Africa with men and women vowing to help survivors of gender based violence.</p>\n<p>A young woman from the dusty streets of Hammanskraal, Stinkwater in Pretoria Hope Rasekhula wrote a book that has real life stories of survivors of gender based violence. The book titled Life on Stilettos, talks about how violence destroys our society and how we can overcome this crisis.</p>\n<p>Real life stories of people who went through heartbreaking and senseless abuse, gives weight to the book because it’s reality and some audiences will be able to relate to the book. What’s more touching than hearing how abuse destroys lives straight from the abused? Nothing.</p>\n<p>It educates individuals about the need to know more about gender-based violence, how to help survivors of abuse. In the book, the mention of God is felt.</p>\n<p>Rasekhula emphasise the need to include God in our time of crisis, how churches can help in changing the mindset of abusers. “Life on stilettos is a combination of words that speak to a conscious community (men and women, society, government, education, church, and individuals) who are facing and are a part of a community where women have been abused,” said Rasekhula.</p>\n<p>“ I mean gender-based violence has been making the headlines in the past few months and that is very concerning. Yes, we are fighting for women, but who is addressing men?”</p>\n<p>“So my book is all about real stories of gender-based violence. Women are victims to a society that is rooted in practices of culture and tradition which happen to oppress some in an open space, however, it kills the whole nation,”</p>\n<p>“Every system going on in the world needs to be told when it is turning a blind eye to some matters. Women injustice does not only break women, it crushes the whole society,” concluded Rasekhula.</p>\n<p>For the 16 Days of Activism Against Gender-Based Violence which is an international campaign to challenge violence against women and girls. Grab yourself \'Life on Stilettos\' , you won’t go wrong with it. The campaign runs every year from 25 November to 10 December.<br>If you need a copy of the book you can contact Hope Rasekhula at hoperasekhula@gmail.com.</p>', 'life-on-stilettos-real-stories-of-survivors-of-gender-based-violence', '2019-11-29 06:48:14', '2019-11-29 07:42:03', 'Blog', 1, 5),
(33, NULL, 'The Colour Box: A book about one the most stereotyped disorder  in Africa', NULL, '<p> </p>\n<p><img src=\"https://helpmyworldpublishing.co.za/laravel-filemanager/photos/165/IMG-20191206-WA0042.jpg\" alt=\"\" width=\"390\" height=\"390\"></p>\n<p> </p>\n<p style=\"text-align:left;\">It is said that our children are a reflection of us, what we teach them is embedded in their minds for the longest of time.</p>\n<p>Question is, can they differentiate what is right and what is not? As parents how can we teach our children not to be stereotypical?</p>\n<p>For centuries people with albinism have been called nasty names, in some cultures they are seen as a curse or bad luck which is not true.</p>\n<p>People born with albinism are human beings just like any other person who does have albinism.</p>\n<p>Back to the question I asked in the beginning, one of the best ways to teach children about things that affect us as a society is to make them read books that will help change their mindset for the better.</p>\n<p>One of the books I would recommend for children to read is The Colour Box by Keitu Reid, which addresses the stereotypes surrounding people born with albinism.</p>\n<p>The book is about an elderly woman whose grandkids came over for the holidays, one day when the grandkids were out playing their soccer ball fell into a neighbours yard.</p>\n<p>Who happens to have a little boy with albinism, the grandkids refused to fetch their soccer ball because they were afraid of the little boy.</p>\n<p>Not having the courage to fetch the ball, the kids then told their grandmother what has happened and how they don’t want to be close to the albino little boy.</p>\n<p>Their grandma was deeply disturbed about the stories and stereotypes her grandkids were telling her about the little boy. Don’t want to be a spoiler alert so let’s just say; she teaches them a lesson.</p>\n<p>This book does not only teach children about albinism but how we should all accept one another the way we are. Also it can teach adults a thing or two.</p>\n<p>Just click on the link to get yourself the copy of the book <a href=\"https://helpmyworldpublishing.co.za/product/the-color-box\">helpmyworldpublishing.co.za/product/the-color-box </a></p>', 'the-colour-box-a-book-about-one-the-most-stereotyped-disorder-in-africa', '2019-12-10 05:02:40', '2019-12-10 05:19:10', 'Blog', 1, 5),
(34, 180, 'Book', NULL, 'How Much Does It Cost To Publish A Book', 'book', '2019-12-16 12:02:09', '2019-12-17 05:12:52', 'Question', 1, NULL),
(35, NULL, '2020 Young Writer\'s workshop programme', NULL, '<p> </p>\n<p><img src=\"https://helpmyworldpublishing.co.za/laravel-filemanager/photos/165/IMG-20200217-WA0022.jpg\" alt=\"Speakers of the Young Writers Programme Workshop at Kyalami Castle, 15 February.\" width=\"390\" height=\"263\"></p>\n<p> </p>\n<p>The department of Education held its annual Young Writer\'s Workshop Programme at the Kyalami Castle in Johannesburg, on Saturday.</p>\n<p>The purpose of the workshop was to educate upcoming writers about the processes involved in making a book and funds that are available to them as young writers.<br>Lazarus Mkhari, the welcoming and opening speaker gave a brief explanation on how young writers can get their books procured.<br>\"For a book to be considered they must submit it to the department, which then will be evaluated. Those that are approved will then be listed and submitted for procurement. A book that is procured has to meet a certain criteria,\" explained Mkhari.<br>Gauteng Education MEC Panyaza Lesufi who was the keynote speaker at the workshop spoke about how the programme started and how important it was for the department to have such a programme.<br>\"If you go to a library in some of our schools. You will think some of us were born in 1920 because there is no material that represents the present or future,\" he said.<br>Lesufi added that \"there is no way that we would get the material if the current writers are not supported or equipped with relevant skills.\"<br>He also highlighted on the importance of funding for writers.</p>', '2020-young-writer-s-workshop-programme', '2020-02-17 14:11:08', '2020-02-17 14:20:08', 'Blog', 1, 5),
(36, NULL, 'I Want My Scars To Count For Something- Busisiwe Anderson', NULL, '<p style=\"text-align:center;\"><img src=\"https://helpmyworldpublishing.co.za/laravel-filemanager/photos/165/IMG-20200221-WA0040.jpg\" alt=\"\" width=\"390\" height=\"390\"></p>\n<p> </p>\n<p>As people we go through hardships which can make or break us. What is it that can be done for one to survive those hardships?<br>A question that has millions of answers because each and every one of us deal with hardships differently. Busisiwe Anderson, a woman who learnt to forgive and found comfort in God has written a book about her life experiences titled \"I Want My Scars To Count For Something.\"<br>With  her book launching this Saturday, Anderson hopes her book changes lives of people from all walks of life.<br>In her book, she opens up about being raped as a teenager how she managed to turn her life around and forgiving those who wronged her.<br>\"It has always been in my heart to speak out about rape, and the impact it has in ones life, long after the violation occurred.\"<br>\"I had seen the destructive path that follows as a result of it, because that is exactly what I went through, which at that time I was certainly not aware what was the root of my behavior.\"<br>\"I do not think the perpetrators have any idea of how destructive and the kind of violation they inflict through rape. And spiritually it has detrimental implications because you become one with your rapist,\" explained Anderson.<br>To hear more about her life experiences buy yourself a copy of her book on <a href=\"http://helpmyworld.co.za\">helpmyworldpublishing.co.za</a> after Saturday or contact her directly. Contacts are in the last sentence.<br>To those attending the launch on saturday there is going to be a question and answer session on how to deal with abuse. For more details on the launch please contact Busisiwe Anderson on <a href=\"tel:0810350972\">081 035 0972</a> or email her on <a href=\"mailto:bu-sisiwe@hotmail.com\">bu-sisiwe@hotmail.com</a>.</p>', 'i-want-my-scars-to-count-for-something-busisiwe-anderson', '2020-02-21 13:40:41', '2020-02-21 13:40:41', 'Blog', 1, 5),
