(4, 7, 'A Rose Called Thandi', 'a-rose-called-thandi', '', '', 'B01', 'white', '<p style=\"font-weight: 400;\">A Rose called Thandi: A tribute to her Legacy is a mind capturing booklet and not a long boring biography but a motivational epitome based on the exceptional way she lived. She started from humble beginnings, An Alter Server, a young soldier of Christ (Lesolenyana), to Catholic youth Organisations. Realized the value of a diary at an early age. Most youth never use diaries, their time is managed by, parents, teachers, friends and recently by cell phones. Wrote challenges, goals, personal qualities and conducted a SWOT.</p>\r\n<p style=\"font-weight: 400;\">Also wrote norms, values, mission, and vision in her diary. Concluded with an Oath, binding herself to reach set objectives or suffer challenges of a junior worker. She then experimented with her life, writing results, positive or negative, capturing everything, a gesture from a priest to being swept across the face by a boyfriend. These were followed by letters of appreciation or regrets. These are captured in Part One: You can read these, and reflect on Original copies in Part Three. She indeed left a Legacy to guide all of us, especially youth and parents.</p>', '<p>None</p>', 287.50, '9008.jpg', 1, 1, '2019-02-13 05:39:12', '2024-01-09 04:16:09', NULL, 1, 'Physical Book', ''),
(5, 6, 'You Don\'t Have To Die', 'you-don-t-have-to-die', '', '', 'B02', 'white', '<p style=\"font-weight: 400;\">The author makes an interesting yet simple and straightforward discussion on whether we should die or not. His interpretation of Bible verses is logical yet faithful to Scripture.</p>\r\n<p style=\"font-weight: 400;\">This book is a Bible study on the biblical fact that God does not want us to die.</p>\r\n<p style=\"font-weight: 400;\">While giving biblical evidence about God&rsquo;s will regarding death and why God would allow people to die, the author presents an in-depth understanding of the Gospel of Jesus Christ and exposes the agent behind all killings of humans.</p>\r\n<p style=\"font-weight: 400;\">This book lets you realize how much God values your life, and it encourages you to reconsider the value you place on your own life and other people&rsquo;s lives.</p>\r\n<p style=\"font-weight: 400;\">The discussion in the book is made accessible and appealing to both the layman and the scholar.</p>\r\n<p style=\"font-weight: 400;\">After reading this book you will realize that, actually, there is nothing like &ldquo;dying by faith&rdquo; but &ldquo;living by faith&rdquo;. Unless, of course, if you are martyred.</p>\r\n<p style=\"font-weight: 400;\">ABOUT THE AUTHOR</p>\r\n<p style=\"font-weight: 400;\">Anthony Mpho Matlala is a mathematician who currently works as a researcher/analyst. He holds a Ph.D. in Mathematics from the University of Witwatersrand. He regards himself as a layman when it comes to theology and religious issues. He was a lecturer at the University of Witwatersrand in the School of Mathematics from January 2000 to June 2009. He previously taught Mathematics at the University of NorthWest (Mafikeng) from July 1994 to December 1999.</p>', '<p>None</p>', 250.00, '40805.jpg', 1, 1, '2019-02-13 05:48:40', '2024-01-08 20:16:34', NULL, 1, 'Physical Book', ''),
(6, 6, 'Faith: The Currency Of Exchange In The Kingdom Of God', 'faith-the-currency-of-exchange-in-the-kingdom-of-god', '', '', 'B03', 'white', '<p>This book is written at a time when the church is under siege from diluted and wrong doctrine taught by so-called prophets. These imposters and charlatans have reduced faith to the use of rituals where items such as oil, water, handkerchiefs etc. have become the order of the day in some churches today. As a result, gullible children of God would rather buy these items instead of receiving from God by faith. The church of God has become a marketplace where these ritualistic items are sold to generate money out of believers. Faith is no longer based on the evidence of the things that are not seen but on objects given to the people of God for conferring blessing or protection to the children of God. This book is an attempt to take the church back to true faith based on the word of God alone and not on items.</p>', '<p>None</p>', 200.00, '23246.jpg', 1, 1, '2019-02-13 05:50:13', '2024-01-08 20:14:12', NULL, 1, 'Physical Book', ''),
(8, 12, 'Walking Through The Pain Of Stillbirth: A Mother Of An Angel', 'walking-through-the-pain-of-stillbirth-a-mother-of-an-angel', '', '', 'B05', 'white', '<p>The Pain of losing a child can&rsquo;t be explained, it is unbearable. Visualise your head being chopped off and half your body leaving you. When I lost my precious angel, I was told from the beginning that burial matters will be handled by elderly women (65 years and older). They took over without including or considering me as the father. Which of course prevented me from saying my last goodbyes to my daughter. The loss of my daughter has changed my perception of life, mainly that we do not have control over life. Children are a gift; the best gift you can ever receive.</p>\r\n<p>That we are custodians and channels to care, raise and guide them &ndash; but we do not own them. Aubrey Matimba Ngobeni in our society, the pain of stillbirth is one of those events unspoken about. We dance around the pain and hope for healing, without understanding the depth of giving birth to a dead baby. With this book, I am hoping to bring the pain of stillbirth to the open and make it discussion-friendly. The fact that my husband walked with me through the pain, will make the subject more approachable among men. Making something out of the pain for both of us.</p>\r\n<p>Khanyisa Shirindzi-Ngobeni &ldquo;A mother is not defined by the number of children she has, but by the love she holds in her heart. This book talks to all the mothers holding their babies in their hearts instead of their arms.&rdquo; Ornella Nhlayekiso Shirindzi &ldquo;For those parents whose children are alive but not being held yet in the presence of their hands, this book will infuse the compassion and yearning inside them to seize the moment and to make it right with their children.&rdquo; Eunice Rakhale-Molefe CEM Publishers Heritage &amp; Legacy Building Through Self-Publishing.</p>', '<p>None</p>', 220.00, '50395.jpg', 1, 1, '2019-02-13 05:57:37', '2024-01-08 20:19:38', NULL, 1, 'Physical Book', ''),
(10, 8, 'My Other Lover: Book 1: The Love I Know', 'my-other-lover-book-1-the-love-i-know', '', '', 'B07', 'white', '<p>&ldquo;A deadly affair, countless wealth, temptation, seduction, a thrilling fornication, conformity, a powerful affection, cunningness, lies, betrayal, dangerous fixations, covetousness, exhilarating passion, planned retributions and malice...Is this the ideal recipe for a perfect relationship or of the Other Lover...you decide.&rdquo;</p>', '<p>None</p>', 280.00, '27337.jpg', 1, 1, '2019-02-13 06:00:11', '2024-01-08 20:10:32', NULL, 1, 'Physical Book', ''),
(11, 8, 'My Other Lover: Book 2: Love that is dangerous', 'my-other-lover-book-2-love-that-is-dangerous', '', '', 'B08', 'white', '<p style=\"font-weight: 400;\">Readers:18+</p>\r\n<p style=\"font-weight: 400;\">What happens when the love you know becomes dangerous and life-threatening?</p>\r\n<p style=\"font-weight: 400;\">My other Lover talks deeper about: Love, Rejection, Marriage, Miscarriages, cheating, backstabbing, lies, murder, joy, peace, happiness, celebrations, divorce, circles of friendships both good and bad, faith, submissiveness, pain, freedom, previous lovers, current relationships, and power.</p>\r\n<p style=\"font-weight: 400;\">A Trilogy about:</p>\r\n<p style=\"font-weight: 400;\">25 sets of relationships</p>\r\n<p style=\"font-weight: 400;\">16 Couples</p>', '<p>None</p>', 350.00, '57500.jpg', 1, 1, '2019-02-13 06:01:43', '2024-01-08 20:03:51', NULL, 1, 'Physical Book', ''),
(12, 8, 'My Other Lover: Book 3 Part 1: Love that exists', 'my-other-lover-book-3-part-1-love-that-exists', '', '', 'B09', 'white', '<p style=\"font-weight: 400;\">Readers: 18+</p>\r\n<p style=\"font-weight: 400;\">What happens in the dark will come into the light and never forget that in every beautiful rose there\'s a thorn.</p>\r\n<p style=\"font-weight: 400;\">My other Lover talks deeper about: Love, Rejection, Marriage, Miscarriages, cheating, backstabbing, lies, murder, joy, peace, happiness, celebrations, divorce, circles of friendships both good and bad, faith, submissiveness, pain, freedom, previous lovers, current relationships, and power.</p>\r\n<p style=\"font-weight: 400;\">A Trilogy about:</p>\r\n<p style=\"font-weight: 400;\">25 sets of relationships</p>\r\n<p style=\"font-weight: 400;\">16 Couples</p>\r\n<p style=\"font-weight: 400;\">And over 40 characters</p>', '<p>None</p>', 350.00, '55944.jpg', 1, 1, '2019-02-13 06:03:21', '2024-01-08 20:07:58', NULL, 1, 'Physical Book', ''),
(13, 8, 'My Other Lover: Book 3 Part 2: Love that is eternal.', 'my-other-lover-book-3-part-2-love-that-is-eternal', '', '', 'B10', 'white', '<p style=\"font-weight: 400;\">Readers: 18+</p>\r\n<p style=\"font-weight: 400;\">At the end of it all, it&rsquo;s the heart that decides on who to love.</p>\r\n<p style=\"font-weight: 400;\">My other Lover talks deeper about: Love, Rejection, Marriage, Miscarriages, cheating, backstabbing, lies, murder, joy, peace, happiness, celebrations, divorce, circles of friendships both good and bad, faith, submissiveness, pain, freedom, previous lovers, current relationships, and power.</p>\r\n<p style=\"font-weight: 400;\">A Trilogy about:</p>\r\n<p style=\"font-weight: 400;\">25 sets of relationships</p>\r\n<p style=\"font-weight: 400;\">16 Couples</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">And over 40 characters</p>', '<p>None</p>', 350.00, '146.jpg', 1, 1, '2019-02-13 06:04:54', '2024-01-08 20:05:42', NULL, 1, 'Physical Book', ''),
(14, 7, 'Woman, get your power back', 'woman-get-your-power-back', '', '', 'B11', 'white', '<p>This book will teach and help find your purpose in life. It will make you understand that what you possess in you is greater than your exterior and it will make you understand that, what is in your heart is what will produce from you, what God created you to be.</p>', '<p>None</p>', 330.00, '31343.jpg', 1, 1, '2019-02-13 06:05:36', '2024-01-08 19:58:01', NULL, 1, 'Physical Book', ''),
(15, 7, 'Alpha Woman', 'alpha-woman', '', '', 'B12', 'white', '<p>You initiated your journey towards healing, happiness, control and success...you are on the verge of becoming strong, powerful and unbreakable.... for much that you want to receive most of you is required...Let me guide you towards the right direction...its time you take your position.... Embrace the new and positive You in this new year of prosperity....</p>', '<p>None</p>', 250.00, '71699.jpg', 1, 1, '2019-02-13 06:06:42', '2024-01-08 19:54:41', NULL, 1, 'Physical Book', ''),
(16, 10, 'Psychological Cripple', 'psychological-cripple', '', '', 'B13', 'white', '<p style=\"font-weight: 400;\">This anthology is a voice of an ancient soul clothed in a young woman\'s body. It Promotes self- consciousness, and cries for Revolution.</p>\r\n<p style=\"font-weight: 400;\">Psychological Cripple is an anthology of 30 Poems; written by Mantala Nkoatse, Published by Diaspora Publishers and edited by Barbara Mhangami- Ruwende.</p>', '<p>None</p>', 90.00, '67298.jpg', 1, 1, '2019-02-13 06:08:31', '2020-03-19 15:03:30', NULL, 1, 'Physical Book', ''),
(17, 13, 'Midwives: Let us advise the pregnant woman about the common minor disorders in pregnancy', 'midwives-let-us-advise-the-pregnant-woman-about-the-common-minor-disorders-in-pregnancy', '', '', 'B13', 'white', '<p style=\"font-weight: 400;\">Knowing that one day a woman will hold a beautiful healthy baby in her arms must be one of the greatest dreams for the life of the midwife.</p>\r\n<p style=\"font-weight: 400;\">You boarded the flight to improving your knowledge in common minor disorders in pregnancy including which system is affected, causes, probable causes, signs and symptoms, complications and the midwife\'s role in the management of the 39 disorders. Your dream is to see the pregnant woman holding a beautiful healthy baby in her arms. Allow this book to be your pilot in guiding you towards making the woman enjoy her pregnancy. You will be powerful in giving advice.&nbsp;Fasten your seatbelts and enjoy your flight with the captain.&nbsp;Midwives let us advise the pregnant woman about common minor disorders in pregnancy.</p>', '<p>None</p>', 300.00, '28527.jpg', 1, 1, '2019-02-13 06:10:32', '2024-01-08 19:36:27', NULL, 1, 'Physical Book', ''),
(18, 11, 'Internal Breakthrough', 'internal-breakthrough', '', '', 'B14', 'white', '<p>After overhearing her father&rsquo;s girlfriend in an alarming telephone conversation, Rachel knows she has to find out if her sick father is in danger. Alone she can&rsquo;t do it, but Jackson, her secret fianc&eacute;, agrees to help her. While trying to track Mariam&rsquo;s associates at the hospital, damaging information is revealed, tying her father&rsquo;s medical files to Dr Josh&rsquo;s disappearance. When they find themselves engulfed by death threats, Jackson chooses the easy way out. Rachel acts recklessly, taking out her frustrations by resorting to drugs. She thinks it is all over and Mariam will get married to her father and then let him die. When things turn out disastrously, Jackson shows a new side of his personality and uses his money, strength, and connections for survival.</p>', '<p>None</p>', 220.00, '49641.jpg', 1, 1, '2019-02-13 06:11:34', '2024-01-08 19:46:12', NULL, 1, 'Physical Book', ''),
(19, 11, 'Madness In Duggart', 'madness-in-duggart', '', '', 'B15', 'white', '<p>The year is 1986. While most of Duggart&rsquo;s mentally afflicted inhabitants are scattered in mental hospitals, traditional healers&rsquo; quarters and churches&rsquo; healing quarters, Dooks, like an uncomfortable number of other mentally ill people, is singing to a different tune . . .</p>', '<p>None</p>', 220.00, '20994.jpg', 1, 1, '2019-02-13 06:13:15', '2024-01-08 19:48:44', NULL, 1, 'Physical Book', ''),
(20, 7, 'Embrace Change: Flourish In Times Of Challenges & Crisis', 'embrace-change-flourish-in-times-of-challenges-crisis', '978-0-620-74544-4', 'Rorisang Maimane', 'B16', 'white', '<p align=\"center\">I love you and I believe that you deserve to flourish and enjoy deep success. I also believe that you deserve to live a purpose driven life that is filled with love, satisfaction, blessings, and dreams that come true all the time.</p>\r\n<p align=\"center\">The heart of this book focuses on you, the only person who matters most and the life that you want to create for yourself. You are a winner, you are a blessing and your life is important; everything you want to achieve is very close to your reach.</p>\r\n<p align=\"center\">&nbsp;I have had my share of crisis and challenges, and because I embraced change and worked my way through, I am able to boldly extend my successes and best practices to everyone who is willing to enjoy the satisfaction of rising above all challenges.</p>\r\n<p align=\"center\">&nbsp;My challenges were not any different from what most of you are going through now, what is different is how I was able to rise and gain the advantage over my challenges. In our engagement with this book, you will learn to turn challenges into successful opportunities. You will use your skills, best abilities to create the life that you deserve while embarking on a great journey of leading a purpose driven life. You are everything you need to succeed in life.</p>\r\n<p align=\"center\">Do you ever feel trapped, not moving in your life as you wanted or planned? Are you not achieving your dreams? Not sure what to do with your life, what path you should take? Does success escape from you every day despite giving your best efforts? Are you struggling to get your life in order? Perhaps your life and work are no longer fulfilling and you feel like there is more to your life. Please be cheerful, I will guide you to create opportunities with your skills, gifts and even better you will begin to work on your purpose. I know that you feel that there is more to life than what you know, and yes there is more to life, you can do more with your life and move to greater heights with your business, personal life and more.</p>\r\n<p align=\"center\">The answer to all your challenges is in your purpose, skills, and abilities. Purpose backed up by hard work, knowledge, understanding and exercising your gifts, skills and possibilities will help you to take back your power and authority over circumstances; you will control your goals, processes and desired results, you will be able to predict your success and influence all actions to help you enjoy deep satisfaction and success.</p>', '', 350.00, '73210.jpg', 1, 1, '2019-02-13 06:16:29', '2024-01-05 20:42:00', 18, 1, 'Physical Book', ''),
(21, 13, 'Pregnant Woman’s Guide', 'pregnant-woman-s-guide', '', '', 'B17', 'white', '<p>This book has been written for you with love and respect. You deserve to take charge of your pregnancy (in order to have the rights and the responsibilities) for the benefit of both your baby and yourself.</p>\r\n<p>Once you understand and know more about your pregnancy, you will be able to make informed decisions about yourself and the coming baby. This knowledge will prevent you from worrying unnecessarily, about what is normal.&nbsp;</p>\r\n<p>Pregnancy affects all the systems in your body.&nbsp; These include your body in general, the digestive system, the genitourinary system, musculoskeletal, and the ear, nose, and throat. It is normal that all those systems are affected, but the challenge is how to deal with those changes in a positive way.</p>\r\n<p>You are holding the correct guide to take you on your nine-month journey through pregnancy.&nbsp;</p>\r\n<p>Stay focused and whenever you have a challenge, open the guide and read about, what is worrying you.&nbsp;</p>\r\n<p>Share this knowledge with the world knowing that the author wrote it with love, for this purpose.</p>', '<p>None</p>', 300.00, '67453.jpg', 1, 1, '2019-02-13 06:20:05', '2020-03-19 14:18:45', NULL, 1, 'Physical Book', ''),
(22, 14, 'How to take care of your body as a woman, while on contraceptive', 'how-to-take-care-of-your-body-as-a-woman-while-on-contraceptive', '', '', 'BC12', 'white', '<p>Every women, young adult and youth in this country are allowed to use contraceptives, anytime they choose to control falling pregnant. It is very essential to have guidance before using contraceptives. Contraceptive are excellent and helpful on the body of women especially after giving birth.</p>', '<p>None</p>', 150.00, '61808.jpg', 1, 1, '2019-03-18 13:26:44', '2024-01-09 04:27:03', NULL, 0, 'Physical Book', ''),
(23, 14, 'Implant the best contraceptive for youth', 'implant-the-best-contraceptive-for-youth', '', '', 'B021', 'white', '<p>Implant is an excellent contraceptive for youth. If it can be used effectively, South Africa will have better women in the future.<br />Family planning controls population and is essential for two reasons: first, for benefit of every family, secondly minimises the serious problems of social and ecological effect of population on national, as well as global levels.</p>', '<p>None</p>', 150.00, '84513.jpg', 1, 1, '2019-03-18 13:32:54', '2024-01-09 04:27:25', NULL, 0, 'Physical Book', ''),
(24, 13, 'DAD’S GUIDE', 'dad-s-guide', '978-0-6398118-0-2', 'MBULAHENI RHONA LUPHAI', 'B1116', 'white', '<p>This guide is written to you with respect and love. You play a major role in pregnancy care and support. Be a proud and an active expectant father for your partner to respect, love and honor you. Assist and support your partner with the informed decision makings for pregnancy, births and the care of the coming baby.<br />You are holding the correct guide to make you and your partner enjoy the nine months journey through the pregnancy.</p>', '<p>None</p>', 220.00, '23328.jpg', 1, 1, '2019-06-12 18:45:09', '2020-03-19 14:20:34', NULL, 1, 'Physical Book', ''),
(25, 16, 'Nala And The Save Piggy Bank', 'nala-and-the-save-piggy-bank', '978-0-620-83943-3', 'Gugu Sidaki', 'Nala1', 'White', '<p style=\"text-align: justify;\">A child that understands how money works is a child that is well prepared for the future. The earlier these concepts are taught, the easier it will be to instill healthy financial habits. With simple-to-understand financial principles, the Nala Financial Literacy series teaches basic concepts like saving, sharing and investing in an engaging way. This book is for both parent and child &ndash; and the first step to having those tricky &lsquo;money&rsquo; conversations.</p>', '<p>None</p>', 220.00, '8472.jpg', 1, 1, '2019-07-30 18:34:25', '2024-01-05 20:50:51', 131, 1, 'Physical Book', ''),
(26, 16, 'Nala And the Share Piggy Bank', 'nala-and-the-share-piggy-bank', '978-0-620-83944-0', 'Gugu Sidaki', 'NALA2', 'white', '<p>A child that understands how money works is a child that is well prepared for the future. The earlier these concepts are taught, the easier it will be to instill healthy financial habits. With simple-to-understand financial principles, the Nala Financial Literacy series teaches basic concepts like saving, sharing and investing in an engaging way. This book is for both parent and child &ndash; and the first step to having those tricky &lsquo;money&rsquo; conversations.</p>', '<p>None</p>', 220.00, '11461.jpg', 1, 1, '2019-07-30 18:37:53', '2024-01-05 20:51:20', 131, 1, 'Physical Book', ''),
(28, 16, 'Nala And The Invest Piggy Bank', 'nala-and-the-invest-piggy-bank', '978-0-620-83942-6', 'Gugu Sidaki', 'NALAIV', 'white', '<p style=\"text-align: justify;\">A child that understands how money works is a child that is well prepared for the future. The earlier these concepts are taught, the easier it will be to instill healthy financial habits. With simple-to-understand financial principles, the Nala Financial Literacy series teaches basic concepts like saving, sharing and investing in an engaging way. This book is for both parent and child &ndash; and the first step to having those tricky &lsquo;money&rsquo; conversations.</p>', '<p>None</p>', 220.00, '141.jpg', 1, 1, '2019-07-30 18:50:25', '2024-01-05 20:51:31', 131, 1, 'Physical Book', ''),
(29, 16, 'Nala Series Boxset', 'nala-series-boxset', 'Nala', 'Gugu Sidaki', 'Nalaset', 'white', '<p>A child that understands how money works is a child that is well prepared for the future. The earlier these concepts are taught, the easier it will be to instill healthy financial habits. With simple-to-understand financial principles, the Nala Financial Literacy series teaches basic concepts like saving, sharing and investing in an engaging way. This book is for both parent and child &ndash; and the first step to having those tricky &lsquo;money&rsquo; conversations.</p>', '<p>None</p>', 450.00, '44217.jpg', 1, 1, '2019-07-31 11:03:10', '2019-07-31 11:03:10', 131, 1, 'Physical Book', ''),
(31, 16, 'The Color Box', 'the-color-box', '978-0-6398302-0-9', 'Keitu Reid', 'CLB', 'white', '<p>Teaching children to be kind and show concern and appreciation for others is becoming harder in a world that has many biases and prejudices.</p>\r\n<p>The colour box is a very simple story of how Koko Tshidi teaches her grandchildren the value of empathy and kindness when they do not want to play with Mosweu; their Albino neighbour.</p>\r\n<p>Ingeniously and yet practically &ndash; Koko gives them a lesson on how to be more open minded before making a final judgement. Not only does this book help with instilling empathetic values, it also encourages critical thinking.</p>', '<p>None</p>', 220.00, '77141.jpg', 1, 1, '2019-09-17 09:48:46', '2024-01-05 20:51:43', 23, 1, 'Physical Book', ''),
(32, 16, 'Book', 'book', '978-0-620-65490-6', 'Stacey Fru', '2015', 'Blue', '', '', 170.00, '19098.jpg', 1, 1, '2019-09-18 07:51:07', '2019-09-18 10:21:41', 145, 1, 'Physical Book', ''),
(33, 16, 'Book', 'book-1', '978-0-620-71872-1', 'Stacey Fru', '2016', 'Brown', '', '', 150.00, '60741.jpg', 1, 1, '2019-09-18 08:17:18', '2019-09-18 10:24:33', 145, 1, 'Physical Book', ''),
(34, 16, 'Book', 'book-2', '978-0-620-71872-1', 'Stacey Fru', '2016', 'Brown', '', '', 170.00, '2589.jpg', 1, 1, '2019-09-18 08:18:35', '2019-09-18 10:02:39', 145, 1, 'Physical Book', ''),
(36, 7, 'Succeeding together within the struggle', 'succeeding-within-the-struggle', '978-0-6208430-0-3', 'Siyabonga and Lindiwe Sithole', '9780620843003', 'Yellow and white', '<p>This book is about a young couple in a committed relationship or a new marriage. It will help you understand why it is important to remain together in all that The Lord bring to you. As the saying goes \"We may not have it all but I have you and the love that The Good Lord gives to you\"</p>', '<p>Not water proof but best quality</p>', 180.00, '52694.jpg', 1, 1, '2019-10-01 10:40:26', '2024-01-05 20:53:38', 152, 1, 'Physical Book', ''),
(37, 6, 'I Want My Scars To Count For Something', 'i-want-my-scars-to-count-for-something', '978-0-620-86304-9', 'Busisiwe Olga Anderson', 'My011', 'white', '<p style=\"text-align: center;\"><strong>Busisiwe takes us on an unbelievable miraculous journey about her life and how the grace of God has kept going. Every chapter is a jaw-dropping story where she reveals the strength of God in her life.</strong></p>\r\n<p style=\"text-align: center;\"><span class=\"fontstyle0\">Rape is one of the most violent, cruel, destructive and degrading acts against any human being. It not only leaves an imprint on your physical body, but your soul is greatly affected, and it alters who you are as a human being. No one deserves to go through such pain. </span></p>\r\n<p style=\"text-align: center;\"><span class=\"fontstyle0\">The anger, shame, self-blame, and guilt and all the other things you carry with you as a result of this infliction is beyond what the naked eye can see.</span></p>\r\n<p style=\"text-align: center;\"><span class=\"fontstyle0\"><br />You are not a victim; you are a </span><span class=\"fontstyle2\">VICTOR </span><span class=\"fontstyle0\">because you have survived it. This book is not just about rape - it is about finding your way back to yourself.</span></p>\r\n<p style=\"text-align: center;\"><span class=\"fontstyle0\"><br />This book, through my story, is an example of how you can rebuild your life - with the mercy of God. Amid </span><strong><span class=\"fontstyle3\">confusion, pain, anger, guilt, hopelessness, fear and rejection </span></strong><span class=\"fontstyle0\">there is still hope and a way of escape even today.<br /></span><strong><span class=\"fontstyle3\">Let my scars count for something in your life.</span> </strong></p>', '<p>None</p>', 287.50, '71008.jpg', 1, 1, '2020-02-13 15:06:17', '2024-01-05 20:53:29', 36, 1, 'Physical Book', ''),
(38, 5, 'Legacy of a rain queen -The eagles Martial', 'legacy-of-a-rain-queen-the-eagles-martial', '978-0-620-85721-5', 'Karabo Finger', 'LE01', 'None', '<p>Nolwazi Rahlaga is a survivor of a car crash that killed both her parents when she was but three months old. We follow the story of her awakening to her true identity as the last in the line of great queens and kings. Living in a self-made security bubble, fearful of a violent past and unaware of the responsibilities resting upon her shoulders; she must undergo a unique and painful initiation in order to reawaken the spirit of Modjadji, the rainmaking queen of the Balobedu tribe. Set in 2016 Nelspruit, Nolwazi lives an ordinary life in post-apartheid South Africa, teaching African History at the local university. She meets Mohale Motlalepula, a man who triggers her spiritual awakening. We discover their shared past lives in 1623 Zimbabwe where he was a powerful warrior who helped her escape her father and his deadly plot to have her destiny as the first rain queen denied. Legacy of a Rain Queen, The Eagles Martial is a first in a three part historical saga that follows the lives of the legendary Rain Queens of the Balobedu.</p>', '<p>None</p>', 340.00, '11915.jpg', 1, 1, '2020-03-19 09:34:18', '2024-01-05 20:53:15', 509, 1, 'Physical Book', ''),
(39, 11, 'When Angels Weep', 'when-angels-weep', '978-0-620-87843-2', 'Alvin Erlank', 'WH01', 'white', '<p>Why are young girls and boys disappearing from the streets?</p>\r\n<p>Are they runaways or is something more sinister happening?</p>\r\n<p>Who is Avenging Angel?</p>\r\n<p>Will Major Peter Mandla Sithole and his partner forensic psychologist, Dr. Katherine Jenkins be able to solve the mystery?</p>', '<p>None</p>', 350.00, '50094.jpg', 1, 1, '2020-06-18 06:12:49', '2024-01-05 20:53:05', NULL, 1, 'Physical Book', ''),
(44, 11, 'When Angels Weep', 'when-angels-weep-1', '978-0-620-87843-2', 'Alvin Erlank', 'HMW09', 'white', '<p>Why are young girls and boys disappearing from the streets?</p>\r\n<p>Are they runaways or is something more sinister happening?</p>\r\n<p>Who is Avenging Angel?</p>\r\n<p>Will Major Peter Mandla Sithole and his partner forensic psychologist, Dr. Katherine Jenkins be able to solve the mystery?</p>', '<p>None</p>', 160.00, '23686.jpg', 1, 1, '2020-07-02 06:03:35', '2024-01-05 20:42:43', NULL, 1, 'ebook', '1593677012When Angels Flourish (InDesign)(a5).pdf'),
(45, 7, 'Embrace Change: Flourish In Times Of Challenges & Crisis', 'embrace-change-flourish-in-times-of-challenges-crisis-1', '978-0-620-77410-9', 'Rorisang Maimane', 'HMW10', 'None', '<p align=\"center\">I love you and I believe that you deserve to flourish and enjoy deep success. I also believe that you deserve to live a purpose driven life that is filled with love, satisfaction, blessings, and dreams that come true all the time.</p>\r\n<p align=\"center\">The heart of this book focuses on you, the only person who matters most and the life that you want to create for yourself. You are a winner, you are a blessing and your life is important; everything you want to achieve is very close to your reach.</p>\r\n<p align=\"center\">&nbsp;I have had my share of crisis and challenges, and because I embraced change and worked my way through, I am able to boldly extend my successes and best practices to everyone who is willing to enjoy the satisfaction of rising above all challenges.</p>\r\n<p align=\"center\">&nbsp;My challenges were not any different from what most of you are going through now, what is different is how I was able to rise and gain the advantage over my challenges. In our engagement with this book, you will learn to turn challenges into successful opportunities. You will use your skills, best abilities to create the life that you deserve while embarking on a great journey of leading a purpose driven life. You are everything you need to succeed in life.</p>\r\n<p align=\"center\">Do you ever feel trapped, not moving in your life as you wanted or planned? Are you not achieving your dreams? Not sure what to do with your life, what path you should take? Does success escape from you every day despite giving your best efforts? Are you struggling to get your life in order? Perhaps your life and work are no longer fulfilling and you feel like there is more to your life. Please be cheerful, I will guide you to create opportunities with your skills, gifts and even better you will begin to work on your purpose. I know that you feel that there is more to life than what you know, and yes there is more to life, you can do more with your life and move to greater heights with your business, personal life and more.</p>\r\n<p align=\"center\">The answer to all your challenges is in your purpose, skills, and abilities. Purpose backed up by hard work, knowledge, understanding and exercising your gifts, skills and possibilities will help you to take back your power and authority over circumstances; you will control your goals, processes and desired results, you will be able to predict your success and influence all actions to help you enjoy deep satisfaction and success.</p>', '<p>None</p>', 70.00, '1636.jpg', 1, 1, '2020-07-02 06:44:25', '2024-01-05 20:55:04', NULL, 1, 'ebook', '1593686906Embrace Change Flourish Final 2020 June.pdf'),
(46, 7, 'Succeeding together within the struggle', 'succeeding-together-within-the-struggle', '978-0-620-84837-4', 'Siyabonga and Lindiwe Sithole', 'HMW11', 'None', '<div class=\"category-tab shop-details-tab\">\r\n<div class=\"tab-content\">\r\n<div id=\"description\" class=\"tab-pane active\">\r\n<div class=\"col-sm-12\">\r\n<p>This book is about a young couple in a committed relationship or a new marriage. It will help you understand why it is important to remain together in all that The Lord bring to you. As the saying goes \"We may not have it all but I have you and the love that The Good Lord gives to you\"</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"recommended_items\">&nbsp;</div>', '<p>None</p>', 80.00, '23885.jpg', 1, 1, '2020-07-02 06:50:52', '2024-01-05 20:37:47', NULL, 1, 'ebook', '1593679849Succeeding together withing the struggle Digital Publish.pdf'),
(47, 16, 'Magic Camera', 'magic-camera', '978-0-620-87880-7', 'Rorisang Maimane', 'HMW13', 'None', '<p>Lesedi\'s adventurous experience is nothing new for many children in school. They go through making new friends, overcoming bullying, finding strength, courage, and have moments of weakness. In all these children learn and grow. They find their best selves. Lesedi\'s Magic Camera allowed her to make new friends and start dreaming of one day becoming an entrepreneur. The Magic Camera\'s experience gave other children something to look forward to, it gave them fun imaginations beyond their wildest dreams.</p>', '<p>None</p>', 222.50, '87065.jpg', 1, 1, '2020-08-12 18:45:03', '2024-01-08 19:03:26', 18, 1, 'Physical Book', ''),
(48, 16, 'Garden With Purpose', 'garden-with-purpose', '978-0-620-87881-4', 'Rorisang Maimane', 'HMW14', 'None', '<p>Following one of her adventures from the Magic Camera. Lesedi explored a world of entrepreneurship. She makes money during the school holidays. With nothing but her family garden, Lesedi builds up the courage and confidence to learn how to build a business with the help of her family.</p>', '<p>None</p>', 222.50, '97911.jpg', 1, 1, '2020-08-12 18:47:56', '2024-01-08 19:22:09', 18, 1, 'Physical Book', ''),
(49, 23, 'Magic Camera', 'magic-camera-1', '978-0-620-87880-7', 'Rorisang Maimane', 'MG01', 'None', '<p>Lesedi\'s adventurous experience is nothing new for many children in school. They go through making new friends, overcoming bullying, finding strength, courage, and have moments of weakness. In all these children learn and grow. They find their best selves. Lesedi\'s Magic Camera allowed her to make new friends and start dreaming of one day becoming an entrepreneur. The Magic Camera\'s experience gave other children something to look forward to, it gave them fun imaginations beyond their wildest dreams.</p>', '<p>None</p>', 100.00, '36804.jpg', 1, 1, '2020-08-16 05:31:23', '2020-12-17 07:40:05', NULL, 1, 'ebook', '1597786465magic-camera.epub'),
(50, 23, 'Garden With Purpose', 'garden-with-purpose-1', '978-0-620-87881-4', 'Rorisang Maimane', 'GD01', 'None', '<p>Following one of her adventures from the Magic Camera. Lesedi explored a world of entrepreneurship. She makes money during the school holidays. With nothing but her family garden, Lesedi builds up the courage and confidence to learn how to build a business with the help of her family.</p>', '<p>None</p>', 100.00, '6064.jpg', 1, 1, '2020-08-16 05:33:39', '2020-12-17 07:40:26', NULL, 1, 'ebook', '1597563217garden-with-purpose-entrepreneurial-adventure.epub'),
(51, 7, 'Family Reading Package', 'family-reading-package', '978-0-000-00000-0', 'Rorisang Maimane', 'HMW13', 'None', '<p>This package includes Embrace Change, Magic Camera, and Garden With Purpose.</p>', '<p>None</p>', 400.00, '48923.png', 1, 1, '2020-08-21 03:55:42', '2020-08-21 03:55:42', NULL, 1, 'Physical Book', ''),
(52, 19, 'I Love You Mom', 'i-love-you-mom', '978-0-620-88213-2', 'Ntombizodwa Popi Tefo', 'HMW14', 'Pink', '<p>A perfect gift for mom for every event, day, and season.</p>\r\n<p>There is no emotion or feeling on this planet Earth that is more enjoyable than a mother&rsquo;s unconditional love and care. A loving mom is the greatest person of them all. <br />Therefore, this little book expresses the massive appreciation for a mom who has your back, always.</p>', '<p>None</p>', 200.00, '5152.jpg', 1, 1, '2020-09-01 16:50:30', '2020-09-23 07:24:13', NULL, 1, 'Physical Book', ''),
(53, 17, 'Legacy of a rain queen -The eagles Martial', 'legacy-of-a-rain-queen-the-eagles-martial-1', '978-0-620-85721-5', 'Karabo Finger', 'LGY01', 'Red', '<p>Nolwazi Rahlaga is a survivor of a car crash that killed both her parents when she was but three months old. We follow the story of her awakening to her true identity as the last in the line of great queens and kings. Living in a self-made security bubble, fearful of a violent past and unaware of the responsibilities resting upon her shoulders; she must undergo a unique and painful initiation in order to reawaken the spirit of Modjadji, the rainmaking queen of the Balobedu tribe. Set in 2016 Nelspruit, Nolwazi lives an ordinary life in post-apartheid South Africa, teaching African History at the local university. She meets Mohale Motlalepula, a man who triggers her spiritual awakening. We discover their shared past lives in 1623 Zimbabwe where he was a powerful warrior who helped her escape her father and his deadly plot to have her destiny as the first rain queen denied. Legacy of a Rain Queen, The Eagles Martial is a first in a three part historical saga that follows the lives of the legendary Rain Queens of the Balobedu.</p>', '<p>None</p>', 170.00, '72889.png', 1, 1, '2020-09-24 05:19:46', '2020-09-24 05:56:47', NULL, 1, 'ebook', '1600931985Legacy of the Rain Queen Ebook - Karabo Finger.epub'),
(54, 12, 'Being Fatherless And The InLaws', 'being-fatherless-and-the-inlaws', '978-0-620-86983-6', 'Maureen Siwela', 'BFL', 'Gold', '<p><span class=\"fontstyle0\">The book is about a young girl who grew up without a father. Her mother was impregnated by a guy who later realised that she was pregnant and he disappeared. The young girl grew up to experience the hardships of life in her childhood. A few years later, she got married with the hope that life would get better, her in-laws would appreciate and accept her but that did not happen. Life became worse and unbearable. The in-laws continued to mistreat her and took advantage of her situation.</span> </p>', '<p>None</p>', 200.00, '73269.jpg', 1, 1, '2020-09-25 10:22:23', '2020-09-25 10:22:23', 154, 1, 'Physical Book', ''),
(55, 20, 'The Right Skills for Gigs', 'the-right-skills-for-gigs', '978-0-620-88507-2', 'Sandile Nondlwana', 'TRSGW', 'white', '<p>Set as a drama which plays out in Cape Town, this book skilfully tackles the burning issue of high unemployment rate amongst the youth of our country. While making use of gripping drama, the author offers a plethora of ways by which the youth can join the bandwagon of gig economy - where people simply rely on flexible online platforms and earn income as contractors, freelancers as well as business-owners.</p>\r\n<p>Actually, the whole book is about a whole host of creative ways which the youth of today need to consider in order to generate income for themselves, rather than to wait for the employment opportunities from the government. It\'s definite must-read, especially for the people who want to be part of the 4th industrial revolution. And it\'s highly recommended for learners and young people in general.</p>', '<p>None</p>', 287.50, '2384.jpg', 1, 1, '2020-09-28 12:46:11', '2022-10-18 10:51:08', 186, 1, 'Physical Book', ''),
(56, 16, 'Germi De Covi', 'germi-de-covi', '978-0-620-89357-2', 'Marian HoomaN', 'GDC', 'Blue', '<p><span class=\"fontstyle0\">What<br />is Germi de Covi up to?<br />Is that even his real name?<br />Why does he want you to wash your hands all the time? To sanitize all the time? To wear a mask and sneeze in your elbow sleeve? Does he want to teach us something? We can protect ourselves!</span> </p>', '<p>None</p>', 172.50, '58401.jpg', 1, 1, '2020-10-01 14:00:53', '2022-10-18 10:52:26', NULL, 1, 'Physical Book', ''),
(57, 6, 'The Vows Of A Drug Smuggler', 'the-vows-of-a-drug-smuggler-confession-of-a-flight-attendant-drug-runner', '9780620779500', 'Fofo Motlhaga', 'F011', 'Blue', 'This encapsulates the life of a flight attendant. An unexpected event had set her on a therapeutic, yet dangerous, path. Just as there are two sides to every story, there are two sides to every person.', 'Paperback', 200.00, '1223.jpg', 1, 1, '2022-01-31 18:30:05', '2024-01-06 07:23:39', 1225, 1, 'Physical Book', ''),
(59, 5, 'The Cricket Bachelor', 'the-cricket-bachelor', '978-0-620-95302-3', 'Phumlani Handile', 'CRB', 'Blue', 'The cricket bachelor book will teach you to believe in true love. In this book, the cricket bachelor is from the dusty rural village of lady frère a few kilometers from Queenstown. He is from a much-respected family, but not a wealthy family, a family that offered the basic needs and few luxury lifestyles which is only a car and nothing major. The cricket bachelor has a humbling background. His grandfather was a cricket player and rugby player back in the days. People should learn how humble was the cricket bachelor to move from one relationship to another to find true love, but dating in a Christian way, with the principle of no sex before marriage until he received the love of his life in Cape Town. Finally, he got married and has two kids, a boy and a girl. The cricket bachelor (mark chase) loved cricket very much, just like his grandfather. He even got his wife when he was watching cricket in Cape town at Newland cricket ground.', 'None', 120.00, '13954.jpg', 1, 1, '2022-06-09 17:22:50', '2022-06-09 17:22:50', NULL, 1, 'Physical Book', ''),
(60, 7, 'Embrace Freedom', 'embrace-freedom', '978-0-6397-9765-6', 'Rorisang Maimane', 'EMBF', 'White', 'BECOME THE UNIVERSE\'S FAVORITE\r\n\r\nUNLOCK THE BOUNDLESS GIFTS OF THE UNIVERSE, A FORCE BEYOND WORDS, AND DISCOVER THE PATH TO A HAPPY AND SUCCESSFUL LIFE.\r\n\r\nIt is a story of Lesedi, a tale that unfolds in \"Embrace Freedom,\" where he dares to venture beyond the ordinary and embarks on an extraordinary journey. Driven by the whispers of the universe, Lesedi courageously leaves behind his government job and embraces a life of travel and writing, all in search of something far greater. In the face of daunting challenges that test his spirit and resolve, Lesedi discovers a profound connection to the divine wisdom, mystical beings, and ancient powers. Empowered by this cosmic guidance, he overcomes adversity, finds true freedom, and realizes his deepest dreams. As life takes unexpected turns, Lesedi\'s perspective expands, embracing the enigmatic secrets woven into the fabric of the universe. Responding to its beckoning call, he sets forth on a transformative journey of self-discovery, where profound insights await.\r\n\r\nTHE UNIVERSE IS REACHING OUT TO YOUR VERY SOUL—LISTEN ATTENTIVELY, EMBRACE ITS CALL, AND UNLOCK THE EXTRAORDINARY LIFE THAT AWAITS YOUR EMBRACE.\r\n\r\n\"EMBRACE FREEDOM\" IS AN EMOTIONALLY CAPTIVATING NARRATIVE THAT IMMERSES READERS IN THE REALMS OF STOIC PHILOSOPHY, ILLUMINATING THE PROFOUND SIGNIFICANCE OF ALIGNING ONE\'S PATH WITH THE WILL OF THE UNIVERSE.\r\n\r\nTHE UNIVERSE IS REACHING OUT TO YOUR VERY SOUL—LISTEN ATTENTIVELY, EMBRACE ITS CALL, AND UNLOCK THE EXTRAORDINARY LIFE THAT AWAITS YOUR EMBRACE.', 'None', 350.00, '2020.jpg', 1, 1, '2023-08-07 10:45:28', '2023-08-07 11:24:17', 18, 1, 'Physical Book', '');
