(143, 'Patrick Masina', 'masinapt@gmail.com', 1, 'Msholozi 2484', 'Mpumalanga', 'South Africa', '1240', '0847126540', 'Masina', NULL, '$2y$10$vpqgYB8OYAcY.i1/zoWVu.XZd8YqFWRhflw0t4JMH5qppyZD.wW8i', NULL, '2019-09-17 08:47:00', '2019-09-18 04:40:35', 0, 'Author', 'I am Patrick Thembisa Masina ,age 35 Born at Nkomazi Mpumalanga back home we were a family of 7,I went to various schools due to family movement ,Witbank one of the places Tavistock but then matriculated at Nelspruit Hillaria secondary school .I am independent working as the assistant technician before it was Absa well I got used to the writing while I was at Metric due to some circumstances my family came across with for me it was a chest pouring but back then I used to portray my message via Poetry.   <br /><br />\r\nNow I am a grown up man got married 2011,I have my own place at White river Msholozi we have one handsome boy so we are a family of three & we are God fearing family strongly believe to the Devine strength & protection. I personally view myself as the so diverse person my mind is all over doesn’t rest I could build thousand hectors structure & still in live in shack. I’m funny person simple got lot of skills dance play different sport soccer, basketball. I went for the Basic ambulance coarse hoping I will be more helpful to the community but no luck to that I guess I will be helping my mind to know lot of damages of a person inside, I can say medically I am fit for any challenge that will come my way my book will be another way revealing a person I am inside. I am a go getter I love travelling a lot Mozambique is one of the place I used to visit, I understand lots of things about foreigners well I have respect for them one other thing I love to do research.', 'profile.jpg', NULL, NULL, NULL, NULL, 'patrick-masina'),
(144, 'Victorine Mbong Shu', 'victorine@mbongshu.co.za', 1, '', '', '', '', '', '', NULL, '$2y$10$z0mtjkeYFQgawYYSnyhGHupaRu0z6H3nmVqegZ4nmh2qvqz.4m6/O', NULL, '2019-09-17 12:15:41', '2019-09-18 07:18:44', 0, 'Author', NULL, 'profile.jpg', NULL, NULL, NULL, NULL, 'victorine-mbong-shu'),
(145, 'Stacey  Fru', 'stacey@staceyfru.co.za', 1, 'Johannesburg', 'Gauteng', 'South Africa', '2090', '+27 825486385', '181 Corlett Drive Bramley, Johannesburg, 2018, South Africa', NULL, '$2y$10$c5hx.taWa0QYwo.TyYbB4uJ9hdSgqg6t9oy8tagO0fYiM/CXzbkTe', NULL, '2019-09-17 12:19:43', '2019-09-17 12:46:58', 0, 'Author', 'STACEY FRU BIO\r\nI am a Philanthropist, Child Activist, Inspirational Speaker and 12-year-old International Multiple Award-Winning Bestselling Author of Chapter Books. I wrote my 1st book, ‘Smelly Cats’ without my parents’ knowledge at the age of 7. This book was approved by the SA Department of Basic Education as suitable for young learners from Early Childhood through to Primary Schools.<br />\r\nMy Awards and Recognition include; ‘Smelly Cats’ as the 2016 NDA ‘Best ECD Publication 2015: Special Mention Category’, ‘Young Leader 2016’ for my leading motivational and inspirational roles, and ‘Academic Achievements and Initiatives 2016’ for my writings at the East Wave Radio Nelson Mandela International Community Day Leadership Award. Mail and Guardian Top 200 Young Most Influential South African 2016, a Runner up at the Vita Basadi Awards in the “Young Dignitary Category for 2017,” and a finalist for the “Gauteng Premier’s Women of Excellence Awards 2018” in The Girl Child Category. I won in the Category of Skills Development and Education in the “Gauteng Premier’s 2nd Youth Excellence in Service Awards 2018;” In March 2019, I was the youngest of 14 youths from Arab and Africa that were awarded during the “Arab Africa Youth Platform 2019;” a World Youth Forum initiative and first of its kind hosted under the auspices of the President in Egypt, President Abdelfattah El-Sisi. My most recent award is “African Child Award for Creative Writing and Social Impact.” Pan African Leadership and Entrepreneurship Development Centre (PALEDEC) in partnership with International Human Rights Commission.<br />\r\nI am the youngest founding member of the Wits University Centre for Multilingual Education and Literacy in 2016. My 3rd book “Smelly Cats on Vacation” was launched on the same day as my education foundation - The Stacey Fru Foundation, through which I empower others. My 2 books; Tim\'s Answer and \"Where Is Tammy<br />\r\nI write stories, essays, poems, speeches and attempts songs. I am a guitarist and a ballerina, a motivational speaker, storyteller, poet, TV talk show host, chairlady, and teacher.', 'stacey-fru', '@staceyfru', 'www.facebook.com/staceyfru', NULL, NULL, 'stacey-fru'),
